  {user_id: 71, question_id: 165, answer_text: "en realidad abarca la educacion, mejorar la educacion en mexico a traves de una escuela que puedan entrar personas normales a una misma clase y con niños de discapacidad conviviendo juntos y empezar a enseñar a las nuevas generaciones que la educacion es la base que todos los ciduadanos necesitamos para cambiar mexico, y realizar un cambio social. ", rubric_id: nil},
  {user_id: 71, question_id: 166, answer_text: "la verdad es que no se, en que tendencias entraria mi emprendimiento de una escuela, y en mejorar la educacion de mexico de un modo innovadora.\r\n", rubric_id: nil},
  {user_id: 71, question_id: 168, answer_text: "La tasa de deserción de los hombres supera al de las mujeres. En educación primaria la brecha es de 0.2 puntos porcentuales; en secundaria se amplía a 2, y en educación media superior es de 3.7.\r\n\r\nesto nos dice que las nuevas generaciones de niños  varones, no cursa la primaria, y deserta y llega a tener problemas en la educacion escolar.\r\n\r\nfuente: http://ediciones-sm.com.mx/?q=blog-10-datos-que-debes-conocer-sobre-el-estado-de-la-educacion-en-mexico\r\n\r\n  La educación primaria es la de mayores deserciones en los últimos 30 años\r\n\r\nnos dice que ahora en un promedio de niños de entre los 6 a 12 años ya no cursan sus estudios de primaria a nivel mundial. incluyendo el pais mexico, y que la mayoria ya no estudia o no encuentran en este caso sus padres la solucion para  que la escuela sea del agrado de ellos y buena para su hijo.\r\n\r\nfuente: \r\nhttp://ediciones-sm.com.mx/?q=10-datos-educacion-mundial", rubric_id: nil},
  {user_id: 71, question_id: 167, answer_text: "2020, nuevos modelos de educacion\r\n\r\nnos dice  es un modelo de\r\nconcertación y coordinación flexible y descentralizada\r\ncon un sistema estatal de innovación e interacción entre\r\nempresas, mercado, gobiernos y universidades.\r\n\r\nfuente: \r\nhttp://www.redalyc.org/articulo.oa?id=37312911005\r\n\r\nLos escenarios cuantitativos de matrícula, de titulación,\r\nde cobertura y la problemática en general de la\r\neducación superior para el año 2020, están determinados\r\npor las condiciones de desigualdad, inequidad e injusticia\r\nsocial. \r\n\r\nSe requiere de una expansión del sistema educativo\r\nasí como de iniciativas gubernamentales y de otros\r\nsectores de la economía y de la sociedad, para favorecer\r\nel ingreso de la demanda social y ampliar la cobertura\r\ndel sistema.\r\n\r\nfuente: \r\nhttp://www.redalyc.org/articulo.oa?id=37312911005", rubric_id: nil},
  {user_id: 71, question_id: 169, answer_text: "EN 2012 México ocupaba el primer lugar de los países de la OCDE de maestros con falta de preparación, retardos y ausentismo.\r\neducacion. \r\n\r\nla educacion en mexico, no se puede mejorar si no empezamos por tener maestros competentes y que amen el trabajo que realizan. \r\n\r\nhttp://wradio.com.mx/programa/2016/04/06/martha_debayle/1459969610_343285.html\r\n\r\nMEJORAR LA EDUCACION. ", rubric_id: nil},
  {user_id: 84, question_id: 37, answer_text: "Persona física", rubric_id: nil},
