  {user_id: 53, question_id: 144, answer_text: "La Biomimética es la ciencia que imita los modelos, sistemas, procesos y elementos naturales para encontrar soluciones prácticas y sustentables a necesidades humanas. El método de diseño de la Biomimética está representado por una espiral en la que se trabaja siguiendo estos pasos: identificar desafíos, interpretar información del diseño, descubrir modelos naturales, resumir principios del diseño, emular estrategias de la naturaleza, evaluar contra principios de la vida. \r\nEl artículo presenta ejemplos de desarrollos de la Biomimética como un material de adhesión similar a las patas de los Gecko que puede adherirse a diversas superficies con el cuál una persona podría trepar una pared, o como pantallas, pinturas y cosméticos que reflejan la luz como lo hacen las alas de la mariposa, también ejemplifica sensores de vapores contaminantes que imitan las escamas de las alas de la mariposa Morpho e  informa sobre robots en forma de insectos que se trasladan en diversos terrenos y superficies inclinadas.", rubric_id: nil},
