  {user_id: 53, question_id: 147, answer_text: "El intraemprendimiento consiste en una herramienta de crecimiento de una empresa a través de iniciativas de innovación de productos y servicios por parte de sus empleados. Los intraemprendedores parten de una plataforma existente y hacen crecer a las compañías, a diferencia de los emprendedores que fundan una empresa a partir de cero.  Como similitudes entre los intraemprendedores y los emprendedores el artículo enlista: capacidad de asumir riesgos, orientación al logro, autoconfianza, enfoque en objetivos, trabajo en equipo y bajo presión, olfato para las oportunidades, compromiso con un objetivo común, perseverancia, organización y planificación.", rubric_id: nil},
