  {user_id: 53, question_id: 150, answer_text: "La Globalización aplanó el mundo, dotando a países como China e India de Internet (infraestructura que en su mayor parte fue financiada por Estados Unidos) se tuvo como principales agentes del cambio a los ingenieros de dichos países, pues ahora pueden sin mudarse a otro país acceder a mejores empleos. El artículo explica que los países que acabo de mencionar ya tenían tiempo formando capital humano en ingeniería en números muy superiores a aquellos de los Estados Unidos, sin embargo, no fue hasta que China e India contaron con Internet que comenzaron a quedarse con trabajos que en otros tiempos hubieran sido exclusivos para quienes vivieran en Estados Unidos. De hecho se considera una crisis de formación de capital humano en ingeniería que Estados Unidos no está atendiendo.   \r\n", rubric_id: nil},
