  {user_id: 79, question_id: 166, answer_text: "Tendencias a cambios demográficos y sociales: Compras locales, economías compartidas, emprendimiento social, Smart cities, responsabilidad social, marketing con causas. \r\nTendencias a cambios climáticos y escasez de recursos: Modelos sustentables y nuevos fertilizantes. \r\nTendencias de Urbanización acelerada: intraemprendimiento, servicios on-demanda, producción flexible. \r\n\r\nDirecta: comercio.\r\nIndirecta: utilizar fertilizantes orgánicos para la producción de forrajes y mantener una alimentación sana para los animales y por ende beneficiar a los consumidores con un producto de calidad. \r\n\r\n\r\n\r\n", rubric_id: nil},
  {user_id: 53, question_id: 153, answer_text: "Big data se refiere al volumen de información estructurada y no estructurada que llega a un negocio, este puede ser analizado para obtener guías que lleven a mejores decisiones y mejores estrategias de negocios. El analista Doug Laney integró el big data como las 3 V: Volumen se refiere a los datos que son colectados a partir de fuentes como transacciones comerciales, medios sociales e información máquina-máquina; ahora existen nuevas tecnologías como Hadoop que permiten su almacenamiento. Velocidad dado que los datos llegan muy rápido y deben ser tratados con oportunidad se han diseñado etiquetas RFID, sensonres y métricos inteligentes que lidian con datos en tiempo real. Variedad, los datos aparecen en formatos estructurados como las bases de datos numéricas y no estructurados como documentos de texto, correos electrónicos, vídeos, audios, datos de inventario y transacciones financieras. Variabilidad, la velocidad y variedad de datos hacen que los flujos de los mismos sean altamente inconsistentes y que incluyan picos periódicos como lo que sucede en el social media en donde la cantidad de datos detonada por eventos puede ser muy complicada de manejar. Complejidad, los datos hoy en día provienen de fuentes diversas complicando la vinculación, empate, limpieza y transformación de datos a través de los sistemas por lo que se deben conectar y correlacionar relaciones, jerarquías y múltiples vínculos de datos para que no se salgan de control los mismos. ", rubric_id: nil},
