  {user_id: 79, question_id: 163, answer_text: "Planta procesadora de leche y productos lácteos\r\n \r\nEsta idea de negocio nace en el municipio de Tzitzio Michoacán uno de los municipios que se encuentran en un grado de marginación y pobreza muy alta, en la cual la mayoría de las familias dependen del ingreso de su trabajo como pequeños productores de bovinos de doble propósito, al ver la necesidad de poder ayudarlos se dio a la tarea de ver la manera de cómo obtener más provecho de dicha producción, para lo cual nos dimos a la tarea de crear un proyecto en la cual todas las familias productoras tengan un ingreso mayor, producto de su propio trabajo. \r\n\r\nEl origen del proyecto proviene de la necesidad de las familias que no cuentan con un empleo y sueldo fijo, al encontrarse en la necesidad de obtener un ingreso las familias recurren a la migración, saliendo de su lugar de origen en busca de una mejor calidad de vida, por esto se tomó la iniciativa de crear un proyecto en la cual ellos puedan auto emplearse sin tener la necesidad de emigrar a otros países.\r\n\r\n", rubric_id: nil},
  {user_id: 79, question_id: 169, answer_text: "Problema a solucionar (desempleo y pobreza): Tzitzio tiene un total de (85.7%) en el nivel de pobreza sobre la población total, encontrandoce en el lugar numero 4 de alta marginacion, esto nos indica que es uno de los principales problemas que se tienen que solucionar, esto con proyectos productivos que creen oportunidad de nuevos empleos y desarrollo, http://www.coneval.org.mx/coordinacion/entidades/Documents/Informes%20de%20pobreza%20y%20evaluaci%C3%B3n%202010-2012_Documentos/Informe%20de%20pobreza%20y%20evaluaci%C3%B3n%202012_Michoac%C3%A1n.pdf", rubric_id: nil},
