  {user_id: 79, question_id: 167, answer_text: "Emprendimiento social: Cerca de 463,000 resultados (1.13 segundos), https://www.google.com.mx/search?q=emprendimiento+social&oq=emprendimiento+social&aqs=chrome..69i57j0l5.1003j0j9&sourceid=chrome&ie=UTF-8#q=emprendimiento+social+en+2020\r\n\r\nServicios on-demanda: Cerca de 2,380,000 resultados (0.36 segundos, https://www.google.com.mx/search?q=emprendimiento+social&oq=emprendimiento+social&aqs=chrome..69i57j0l5.1003j0j9&sourceid=chrome&ie=UTF-8#q=servicios+con-demanda+en+el+2020", rubric_id: nil},
  {user_id: 108, question_id: 43, answer_text: "Familia", rubric_id: nil},
  {user_id: 79, question_id: 170, answer_text: "El mercado de productos lácteos en México, que incluye la venta de leche pasteurizada, yogurts, quesos, mantequilla y otros derivados, alcanzará un valor de 173 mil 416 millones de pesos en 2013, de los cuales, 71 mil 442 millones de pesos corresponderán a la venta de leche empacada, de acuerdo con Euromonitor International.\r\n \r\nLa expectativa de crecimiento para la venta de leche empacada es que aumente 24.4 por ciento en ingresos en los próximos cinco años, es decir, los ingresos captados por estos productos llegarán a más de 88 mil 863 millones de pesos para 2018, sin contar la inflación, explicó Beatriz Torres, analista de la consultora de mercados. http://www.elfinanciero.com.mx/archivo/lala-y-alpura-destapan-estrategias-para-crecer-1.html\r\n\r\nLa producción de leche en China se redujo 5.7% en 2013, lo que dio lugar a una fuerte\r\ndemanda de importaciones de productos lácteos y precios mundiales más altos. Además,\r\ndurante el primer semestre de 2013, los principales actores del mercado mundial de\r\nproductos lácteos —Estados Unidos de América, la Unión Europea, Nueva Zelanda y\r\nAustralia— produjeron menos leche que un año antes. Las principales razones fueron los\r\naltos costos del forraje y las condiciones climáticas adversas en Oceanía y algunas partes\r\nde Europa. Los precios de la leche descremada en polvo (LDP) y la leche entera en polvo\r\n(LEP) alcanzaron un nuevo máximo en abril de 2013, por encima del nivel en el auge de los\r\nproductos básicos de 2007-2008. http://www.fao.org/3/a-i4738s/i4738s07.pdf\r\n\r\nLos productos lácteos tienen un gran ahuje en el mercado, es por esta razón que se implemento esta idea como una de las opciones ya que el municipio se dedica a la producción de bovinos de doble propósito. ", rubric_id: nil},
