  {user_id: 106, question_id: 82, answer_text: "*el precio supone la principal desventaja de las soluciones existentes, ya que su tamaño es muy grande por lo tanto el valor de su renta es mayor\r\n*su tamaño hace que sea necesario destinar mucho tiempo en labores de mantenimiento y limpieza\r\n*por su alto precio es necesario compartir el hospedaje con otras personas que tal vez no se conozcan entre si ocasionando conflictos y desacuerdos\r\n*el alquiler del inmueble puede estar sujeto a reglas y acuerdos que no sean del todo cómodos y aceptables por los huéspedes potenciales \r\n*su ubicación quizá fue planeada pensando en otro tipo de necesidad (familiar) por lo que la logística y cercanía con los principales centros de estudio hace que se tenga que realizar gastos extra en servicios como transporte por ejemplo\r\n", rubric_id: nil},
