  {user_id: 142, question_id: 141, answer_text: "El Crowdfunding la financiación de proyectos de manera colectiva a través de Internet. \r\nUno de los sitios más populares y el pionero en este tipo de financiación, KICKSTARTER ha recaudado más de 2,000 MDD en seis años, con lo que ha financiado más de 93,000 proyectos. \r\nUno de los íconos en la plataforma KickStarter, y que además ha batido records de recaudación, es el reloj inteligente llamado PEBBLE. La empresa creadora de este concepto logro recaudar más de 10 MDD, pero lo importante fue la publicidad boca en boca que se genera. \r\nLa escencia del crowdfunding es que tiene una aportación de poco dinero generada por muchas personas, lo que te da financiación, pero sobre todo, le da a las personas un empoderamiento de decidir si tu producto es válido para salir al mercado, o si necesita algunos ajustes antes de su lanzamiento.", rubric_id: nil},
  {user_id: 142, question_id: 143, answer_text: "Economías emergentes", rubric_id: nil},
  {user_id: 142, question_id: 144, answer_text: "La Biomimética, una ciencia que nos permite copiar o emular las funciones naturales de los organismos vivos, para darles una aplicación práctica a la resolución de problemas que enfrenta la humanidad. \r\nSe puede aplicar en una infinidad de procesos, diseño de productos sustentables, empacado de productos, etc. \r\nSe puede decir que es una metodología que nos permite imitar lo que la naturaleza hace de manera eficiente, para resolver los problemas humanos, mediante una seria de pasos.\r\n-Identificar el problema o desafío a resolver.\r\n-Interpretar.\r\n-Descubrir\r\n-Resumir\r\n-Emular\r\n-Evaluar\r\nSu aplicación ha ido popularizándose, y actualmente se han desarrollado proyectos como el de un adhesivo que imita la adherencia que tienen los Geckos en sus patas, que les permite trepar cualquier superficie. \r\nTambién se ha aplicado a desarrollar sensores inspirados en la luminiscencia de algunas mariposas, con el propósito de detectar químicos que puedan ser nosivos para la salud, y hasta enfermedades en las personas con sólo analizar su respiración. ", rubric_id: nil},
  {user_id: 142, question_id: 147, answer_text: "Los intraemprendedores son las personas que realizan proyectos de emprendimiento dentro de organizaciones ya establecidas. Pueden nuevas unidades de negocio, estructuración de procesos, mejora de condiciones, desarrollo de un nuevo producto, etc.\r\nLa única diferencia que tienen contra un emprendedor, es que los intraemprendedores trabajan en una empresa, mientras que los emprendedores comienzan desde cero fundando una. \r\nComparten las mismas características, visión, liderazgo, trabajo por objetivos, y sobre todo son  muy persistentes.", rubric_id: nil},
