  {user_id: 74, question_id: 164, answer_text: "El principal rubro en el cual nuestro proyecto puede generar bienestar es en el balance trabajo-vida ya que ofrecemos brindar tiempo al usuario para realizar sus cosas importantes tales como enfocarse en tiempo de calidad consigo mismo y con su familia, en vez de preocuparse por hacer el mandado. \r\nNos comprometemos con ofrecer la alternativa de proporcionar productos que contribuyan con la salud de las personas y ayuden a llevar una vida más saludable. \r\nBuscamos proporcionar empleo directo e indirecto a una gran cantidad de personas con remuneración digna para que pueda tener un nivel de vida adecuado. \r\nPretendemos contribuir con la economia de nuestros usuarios ya que ofrecemos que el precio de los productos sea del nivel que se ofrecen en las centrales de abastos de las ciudades.\r\n", rubric_id: nil},
