  {user_id: 74, question_id: 165, answer_text: "Avances tecnológicos y urbanización acelerada.\r\n\r\nConsideramos que nuestro proyecto se incluye en la megatendencia de Avances Tecnológicos ya que el servicio se ofrece totalmente mediante el uso de aplicación web y móvil, para que el usuario con solo el ingresar a su computadora o dispositivo móvil pueda realizar el pedido de frutas y verduras y recibir en su domicilio en el momento que el lo desee. \r\n\r\nTambién consideramos que el proyecto puede ser considerado para el área de Urbanización acelerada ya que hemos podido observar que las ciudades más desarrolladas del país tienen un problema de altos costos en transporte y gasto de tiempo para realizar traslados de un lugar a otro. Nosotros atacamos este problema ya que ofrecemos la entrega de los productos en menos de una hora o en el momento que el cliente lo requiera evitando que tenga que salir de su casa o que para cuando se encuentre en su dirección tenga las frutas y verduras que necesita.", rubric_id: nil},
  {user_id: 142, question_id: 150, answer_text: "La globalización ha tenido grandes saltos o etapas a lo largo del desarrollo de la humanidad. Comenzando con la Globalización 1.0 en el periodo del siglo XV al siglo XIX, en donde las fuerza que impulsaron el acortamiento de las distancias entre las personas fueron la búsqueda de recursos y la expansión del territorio por medio de las conquistas.\r\nDespués se dio la Globalización 2.0 durante el siglo  XIX y principios del siglo XXI, en donde se dio un impulso mediante la expansión de las compañías privadas, que buscaban mayores operaciones y mejor y más barata mano de obra.\r\nLuego surgieron individuos que quisieron externalizar sus actividades, no sólo buscando lugares en dónde encajar, sino adquirir un conocimiento diferente al que se encuentra en su lugar de origen. Es así como surge la nueva idea de que el mundo es plano, se puede llegar a cada rincón del planeta con demasiada facilidad.", rubric_id: nil},
