  {user_id: 142, question_id: 153, answer_text: "El big data es la acumulación de información de manera digital o física. Es una herramienta que puede beneficiar enormemente a las empresas, ya que puede permitir una toma de decisiones más eficaz y valorizar un negocio.\r\nPara que el big data sea más efectivo, se tienen tres consideraciones a tener en cuenta para su recolección.\r\nDebe ser de un volumen muy extenso para tener una elección más acertada. Hoy en día se recopilan datos de transacciones bancarias, por medio de sensores, encuestas y patrones de consumo. En fin, se puede recopilar datos de múltiples fuentes. \r\nSe debe tener en cuenta la velocidad con la que se obtienen los datos. Los datos entre más actualizados y con mayor rapidez se obtengas, podrán ser de mayor ayuda.\r\nDeberá de haber una gran variedad en la información que se capture, ya que no podemos quedarnos con un solo tipo de información. Tendrá que ser de tipo numérico, texto, audio, etc. Esto con la finalidad de tener fuentes confiables y que otorguen mayor información para la toma de decisiones. ", rubric_id: nil},
