  {user_id: 129, question_id: 174, answer_text: "Los cambios demográficos y sociales que se han sucitado en los últimos años han hecho que la economía compartida y el E-commerce se proyecten a futuro como la manera más sencilla de tener acceso al consumo moderado de un bien o servicio. Tendencias como el \"Crowdsourcing\" permiten una colaboración social más abierta y equitativa.\r\n\r\nDe cada 10 chicas en Guadalajara, 7 tienen al menos 3 vestidos de fiesta que raramente usarán otra vez y piensan que el mayor problema al buscar un nuevo vestido es el precio, debido a que la mayoría de ellas han pagado 2000 MXN o más para adquirir uno.\r\n\r\nA 9 de esas 10 chicas estarían dispuestas a utilizar una app que les permita visualizar un gran catalogo de vestidos de fiesta de diferentes marcas, diseñadores jóvenes mexicanos y diferentes precios, e incluso vestidos de otras usuarias, adquirirlos (rentar o comprar) con un método de pago mediante la aplicación y recuperar su inversión de vestidos propios al subirlos a la plataforma.\r\n\r\n\r\n\r\n", rubric_id: nil},
  {user_id: 129, question_id: 175, answer_text: "Capacidad de adquirir vestidos de fiesta para un evento específico a precios accesibles y capacidad de compartir vestidos propios para recuperar la inversión en ellos\r\n\r\n2000 MXN o más es la cantidad que arriba del 50% de chicas en Guadalajara pagan por un vestido de fiesta que usarán muy poco\r\n\r\nCambios demográficos y sociales\r\n\r\nLa economía compartida y el E-commerce permiten facilitar el acceso a un consumo moderado \r\n\r\nCrowdsourcing \r\n\r\n7 de cada 10 chicas en Guadalajara piensan que el mayor problema al buscar un vestido de fiesta es el precio y tiene al menos 3 vestidos de fiesta que raramente usarán otra vez.\r\n\r\n9 de cada 10 chicas en Guadalajara usarían una app que les permita buscar, comprar, alquilar y compartir vestidos\r\n\r\n5449 mujeres egresaron en 2015 de la Universidad de Guadalajara en la zona metropolitana\r\n\r\nLa app podría facilitarle a las usuarias visualizar un gran catalogo de vestidos de fiesta de diferentes marcas, diseñadores jóvenes mexicanos y diferentes precios, e incluso vestidos de otras usuarias, adquirirlos (rentar o comprar) con  un método de pago mediante la aplicación y recuperar su inversión de vestidos propios al subirlos a la plataforma.\r\n\r\n\r\n\r\n", rubric_id: nil},
  {user_id: 129, question_id: 117, answer_text: "Megatendencia", rubric_id: nil},
  {user_id: 129, question_id: 141, answer_text: "El crowdfunding es una herramienta en la cuál starups presentan su producto o servicio en una plataforma donde personas de todos los ámbitos pueden hacer aportaciones económicas para financiar dicho proyecto.\r\nUn ejemplo de este tipo de plataformas es Kickstarter quien ha recaudado alrededor de  2.000 millones de dólares depositados en más de 93.000 proyectos.\r\nPero no sólo se queda en el financiamiento. El crowdfunding representa una manera eficiente para pronócticar la aceptación del producto o servicio en el mercado, tal fue el caso de Pebble, quien tras obtener una exitosa ronda de inversión, vendió más de un millón de relojes en los siguientes años.\r\nEl mundo se dio cuenta que \"El crowdfunding es siempre más crowd que funding, porque empodera a las personas y las dota de la capacidad de decidir si quieren o no que una iniciativa salga adelante.\" Incluso se puede considerar que promueve la creatividad colectiva ya que los participantes puede comentar y enriquecer el producto antes de que salga al mercado.\r\n", rubric_id: nil},
