  {user_id: 129, question_id: 144, answer_text: "La biomimética es una ciencia que se encarga de estudiar como la naturaleza misma ha resuelto los problemas a los que se ha enfrentado a través de miles de años de evolución para crear un modelo semejante para que nuestro mundo funcione como el mundo natural.\r\nToda innovación en éste ámbito se puede sustentar con un diseño de espiral para imitar la naturaleza. Dicho espiral se compone de lo siguiente:\r\n1. Identificar desafíos reales\r\n2. Interpretar información del diseño\r\n3. Descubrir modelos naturales\r\n4.Resumir principios del diseño\r\n5.Emular las estrategias de la naturaleza\r\n6.Evaluar contra los principios de la vida\r\n\r\nAlgunos ejemplos son:\r\n-El material desarrollado en la Universidad de Manchester que permite a las personas trepar diferentes superficies al cubrirse las manos con él, reproduciendo así la adhesión Gecko.\r\n-Las pinturas y cosméticos que utilizan el principio de reflexión de la luz, al igual que las mariposas, para generar colores llamativos sin necesidad de usar metales tóxicos y a un bajo costo energético.\r\n-La compañía General Electric trabaja en una nueva generación de sensores, basandose en las mariposas, capaces de detectar explosivos, armas químicas e incluso enfermedades por medio de biomarcadores.\r\n-Construcción de robots basados estructuralmente en insectos. Esto con la finalidad de que los robots puedan desempeñar tarea que con la estructura ósea de un humano serían muy complicadas.\r\n-Circuitos básicos de neuronas nerviosas que funcionan como generadoras de pulsos. ", rubric_id: nil},
