  {user_id: 129, question_id: 147, answer_text: "El intraemprendimiento y el emprendimiento son muy semejantes; en ambas las personas tienen la capacidad de tomar riesgos, están orientados hacia objetivos claros, son atrevidos y manejan niveles altos de autoconfianza, ven oportunidades de negocio, de crecer, donde las demás personas no lo hacen. Saben trabajar en equipo, teniendo un amplio sentido de planeación y organización. \r\nSin embargo la principal diferencia es que un emprendedor parte desde cero, mientras que un intraemprendedor parte de una plataforma existente, es decir, están dentro y tienen el respaldo de una compañia o una organización, al buscar mejorar un producto o lanzar una nueva unidad de negocio.", rubric_id: nil},
