  {user_id: 129, question_id: 150, answer_text: "El concepto de Globalización 3.0 hace referencia a la transformación de los sistemas de conexión global que han revolucionado la manera de hacer negocios, buscar y seleccionar personas capacitadas para cierta actividad, el acceso a la información y en general toda las herramientas que permiten la cooperación intelectual sin importar en que parte del mundo estén los usuarios. \r\n\r\nEste fenómeno, donde ya no es necesario emigrar para innovar, se desarrolló por la convergencia de 10 eventos que se dieron durante los últimos 30 años. Desde el derribamiento del muro de Berlín como símbolo de destrucción de barreras, la introducción de Nestcape que permitió que personas de diferentes partes del mundo se conectaran entre sí de diferentes maneras, la implemetación del outsourcing, offshoring, open-sourcing, insourcing, supply-chaining hasta los elementos catalizadores como el desarrollo de la conexión wireless o el VoIP han creado un \"terreno de juego global\", interconectado por la red, permitiendo  múltiples formas de colaboración  en  investigación y trabajo, independientemente de la posición geográfica. \r\nLa convergencia de nuevos jugadores, en un nuevo terreno de juego desarrollando nuevos procesos de colaboración horizontal, y ya no vertical como lo era anteriormente, es una gran fuerza que está dando forma a las nuevas economías y políticas de este jóven siglo.\r\nActualmente no hay nada que garantice que las viejas potencias, como Europa o EUA, continuen con la influencia y el liderzgo mundial, sin embargo aquellas naciones, compañias e individuos que estén a la vanguardia tecnológica y descubran las herramientas con la que cuentan para competir globalmente podrán trascender. Herramientas que los ayudarán a estar mejor preparados y ser más productivos.\r\n", rubric_id: nil},
