  {user_id: 129, question_id: 153, answer_text: "El término Big data se refiere a un basto conjunto de datos, estrucutrados o no, que varias organizaciones pueden recopilar, para posteriormente analizarlos, y así tomar mejores desiciones y hacer movimientos estratégicos financieros.\r\nAños atrás ya se hacían análisis de datos, pero el concepto \"Big data\" como tal se refiere a un gran volumen de datos, variados, variables y complejos que son recibidos a altas velocidades. \r\nLos datos obtenidos por sí solos no son productivos, es necesario analizarlos para obtener información de ellos, obtener conceptos. Una vez que comprendemos los conceptos generados estaremos en una etapa de conocimiento, pero hasta que apliquemos efectivamente el conocimiento para tomar desiciones lograremos tener sabiduría.\r\nLos beneficios que se pueden alcanzar al analizar pueden ser reducir costos, tiempo, descubrir fallas o defectos en tiempo real, recualcular portafolios de riesgo en minutos o incluso detectar comportamientos fraudulentos dentro de la organización.\r\nBasicamente todas los sectores industriales pueden beneficiarse de Big Data: Banquero, educación, gobierno, servicios médicos, manufactura etc..\r\n\r\n ", rubric_id: nil},
