  {user_id: 56, question_id: 163, answer_text: "El origen se da al reconocer la necesidad de implementar estructuras y tecnologías sustentables para la recolección y aprovechamiento de basura orgánica e inorgánica. \r\n\r\nYa que todos los días veo en las calles pasar camiones \"No Aptos\" atascados de basura revuelta y generando gases contaminantes al por mayor.\r\n\r\nSe requiere con voz de urgencia, adoptar una estructura nueva para recolectar basura separada por el usuario y aprovecharla para beneficio del segmento agropecuario con abono; y materias primas para los pequeños y medianos fabricantes.", rubric_id: nil},
