  {user_id: 129, question_id: 161, answer_text: "- México ocupa el 9°no lugar de países que emiten gases de efecto invernadero.\r\n- México aporta 1.67% de las emisiones de gases de efecto invernadero mundiales.\r\n- A pesar que ha invertido millones de dólares en energías renovables, ésta transición aún se ve mermada por malas prácticas como la deforestación.", rubric_id: nil},
