  {user_id: 53, question_id: 64, answer_text: "Incorporando la posibilidad de que padres e hijos se ejerciten en el mismo horario aunque cada uno en una actividad apta para su edad.", rubric_id: nil},
  {user_id: 33, question_id: 163, answer_text: "Apenas hace dos meses el refrigerador de casa se daño y por la falta de tiempo  me fue difícil buscar un técnico especializado que me ayudara a diagnosticar la falla y describiera los servicios que ofrecía; existe la famosa sección amarilla (en físico), pero sólo accesible par quienes tienen una linea telefónica con cierta compañía y la versión digital muestra las empresas que contratan el servicio de la versión física, la idea es desarrollar una plataforma que por un lado se puedan encontrar personas y/o talleres que ofrezcan los servicios de reparación de electrodomésticos, aparatos eléctricos, equipo de cómputo entre otros y que por otro lado, que las personas que sepan reparar esos equipos se puedan dar a conocer, es decir, se pueden ganar un dinero extra.\r\n\r\nEjemplo: Juan es un Técnico en Informática que trabaja de 8:30 a 16:30 en una dependencia de Gobierno, debido a no querer perder las bondades de las prestaciones que le ofrecen (Aguinaldo, Servicio de Seguridad social, etc.), no renuncia; pero se desea ganar una lana extra y ofrece sus servicios de reparación de equipo de cómputo después de su horario laboral, sin embargo no cubre la ciudad repartiendo volantes por lo que publica sus servicios en SinFallas.mx y ademas en la plataforma especifica lo que ofrece al hacer un mantenimiento preventivo o correctivo, si pasa por el equipo a domicilio o cita para el diagnóstico y el feedback de sus anteriores clientes.", rubric_id: nil},
  {user_id: 53, question_id: 69, answer_text: "Uso de tecnología de la sociedad bajo demanda para facilitar la integración de grupos concurridos con menos horarios lo cual implica menos horas-instructor por pagar. ", rubric_id: nil},
  {user_id: 33, question_id: 164, answer_text: "Los ingresos de las personas que cuentan con bajos salarios que sepan hacer reparaciones de equipos eléctricos, electrodomésticos, de cómputo, etc. podrán generar dinero extra y así mejorar su calidad de vida de ellos y quienes los rodean; por otra parte los talleres o servicios técnicos al tener presencia en Internet podrán ampliar su mercado y así al verse con mayor demanda podrán generar más empleos.", rubric_id: nil},
