  {user_id: 56, question_id: 164, answer_text: "En la comunidad se genera un bienestar al intercambiar \"algo\" por la basura ya separada. (Omitir costo de \"tirar\" basura).\r\n\r\nIngresos: Al utilizar tecnología sustentable, los costos de transporte, procesamiento y administración se reducen considerablemente favoreciendo proporcionalmente los ingresos de la empresa.\r\n\r\nEmpleo: El plan de recolección de basura amplía horizontes de empleo a cualquier persona apta para trabajar. Desde choferes y ayudantes, como en áreas administrativas y producción.\r\n\r\nSalud: La nueva estructura involucra innovación en control de seguridad e higiene en el manejo de desechos. Y además, al utilizar tecnología sustentable, se reducirán considerablemente dos de los principales gases nocivos para la salud, con efecto invernadero y provocados a gran escala por el hombre: \"C02\" y Metano.\r\n\r\nBalance trabajo vida: La nueva estructura administrativa incluye la innovación de horarios de trabajo de acuerdo a las necesidades actuales de población.\r\n\r\nSatisfacción ante la vida: La basura es el \"producto\" que más producimos cotidianamente, éste, al ser recolectado y aprovechado para el bienestar del medio ambiente y la sociedad, seguro nos genera todos los días una gran satisfacción ante la vida.\r\n\r\nMedio ambiente: La nueva estructura en implementación de tecnología sustentable, beneficia considerablemente al medio ambiente, promoviendo el aprovechamiento de los desperdicios.\r\n\r\nCompromiso civico: El compromiso de la empresa, para nosotros como para la sociedad, es nuestro estilo de vida.", rubric_id: nil},
