  {user_id: 154, question_id: 163, answer_text: "La idea de STEEL INDUSTRIAL, Nace al saber que hay muchos proveedores metal mecánicos en México, los cuales compran material con fabricantes y lo ofrecen a las industrias de la construcción, alimentarias y a todas aquellas empresas que necesiten material para alguno de sus procesos. \r\nSin embargo estas empresas en algunas ocasiones tienen pésimo servicio debido  que en la industria metal mecánica existe una guerra en cuanto a precios y tiempo de entrega, Dentro de los grupos de comercializadores, de acero existen diferentes categorías dependiendo del material que manejen cada uno ACERO INOXIDABLE, ACERO AL CARBON, ACEROS ESPECIALES Y PLASTICOS INDUSTRIALES. \r\n\r\nNuestro objetivo nació al brindar soluciones en cuanto a rapidez, maquila y eficiencia a todas las necesidades de los consumidores en cuanto al material anterior, lo que buscamos que nuestros clientes, tengan el material que necesitan, en el momento que lo necesitan y con las especificaciones necesarias. \r\nComercializamos, Maquilamos y fabricamos lo que el cliente requiera en acero inoxidable, acero al carbón y aceros especiales. \r\n", rubric_id: nil},
