  {user_id: 154, question_id: 150, answer_text: "La globalización 3.0 es un tema que no es posible tocar por encimita, ya que esta conformada por una serie de eventos los cuales han detonado las diferentes revoluciones tecnológicas en el mundo, es un tema el cual se desarrolla por etapas primero con la caída del muro de Berlin en la cual las barreras comerciales y tecnológicas comenzaron a aumentar, seguido del 1re buscador llamado Netscape el cual lograba darle acceso a la informacion a todo el que tuviera acceso a la red ( web ), de ahí el hecho de que inversionistas vieran un negocio invertir en tecnología ( Comunicación ) desarrollando grandes infraestructuras marítimas y subterráneas de fibra óptica con el fin de aumentar la conectividad entre naciones, pero aun un queda la chispa que es la que utiliza esto tres para formar el trabajo colaborativo y fue el error Y2K o problema del año 2000, un problema de programación que logro que los Hindus salieran a relucir, ya que por medio de outsourced lograron solucionar el problema y desarrollar 6 tendencias mas de colaboración que no necesitaban estar precisamente en el mismo lugar. \r\n1* Outsourcing. Sub-contratar los servicios de alguien externo para desarrollar algo. \r\n2* Offshoring. Envio Completo de Fabricas de país a país. \r\n3*Open­Sourcing. Colaboración de ingenieros en linea para desarrollo de sistemas operativos.  \r\n4*Insourcing. Dejo que una compañía se encargue de alguno de mis procesos para  hacerlo mas eficiente. \r\n5* Supply­chaining. Red de proveedores internacional. \r\n6* “Informing”la informacion y colaboración que ofrecen los buscadores. \r\n\r\nLogrando una real revolución tecnológica y con ayuda de un décimo colaborador llamado ( wireless ) y ( VoIP ) que lo que hacen es turbo cargar todas plataformas de colaboración con el fin de poder usarlas en cualquier momento desde cualquier PC, celular o PSP lograron crear un mundo plano. \r\n\r\nLa creación de estas 10 herramientas, a hecho que el mundo comience a avanzar mucho mas rápido, que la conectividad sea mayor y que las exigencias en el mundo de los negocios sea un tema del cual preocuparse, ya que cualquier trabajo que en su debido momento podría hacer cualquier universitario en ingeniería en los estados unidos, ahora los esta haciendo una persona en la india con un sueldo menor y con una mayor calidad. \r\nLa fuga de talentos y la competitividad laboral esta siendo un tema a tratar ya que países que se encontraban en desarrollo están sobrepasando en temas de educación y fuerza laboral a los países desarrollados, es un tema que nos tiene que preocupar, por que esto no es una prueba es el principio de una crisis que no se mantendrá quieta y una crisis es una situacion terrible como para desperdiciarla. \r\n  \r\n", rubric_id: nil},
