  {user_id: 224, question_id: 175, answer_text: "Bienestar: Con el nutriólogo y la plataforma de nutrición podremos ayudar a las personas a que generen educación en salud para mantener una comunidad con bajos indices de enfermedades como hipertensión, diabetes y obesidad\r\nDato duro sobre bienestar:  Debido a que el paciente no cumple con la dieta y el ejercicio durante los primeros\r\nmeses, el doctor le recomienda metformina para controlar los niveles de azúcar. \r\nMegatendencias: Cambios Demograficos y sociales, Cambios en el poder economico mundial y Cambios tecnologicos\r\nMegatendencia directa: Servicios web\r\nMegatendencia Indirecta: Personalización\r\nDato duro sobre el problema que se busca solucionar: Según el contador de la página web del Programa\r\nNacional de Cultura Física y Deporte 2014-2018, se han atendido a 871,363 mexicanos. Esto equivale sólo a 1.8% de los adultos con SPyObes y a 0.83% de la población objetivo.\r\nDato duro sobre el servicio que se quiere desarrollar: Sin un sistema que atienda los factores relacionados con la adherencia terapéutica, los adelantos en la tecnología biomédica no lograrán  reducir la carga de las enfermedades crónicas.” OMS\r\nDato duro sobre el cliente que se quiere: 840 pesos por persona costaria invertir en la prevención de enfermedades crónicas no transmisibles es costo-efectivo. Cecchini et al., 2010  \r\nAlcance : Nivel Global\r\n \r\n\r\n", rubric_id: nil},
  {user_id: 241, question_id: 15, answer_text: "Sí", rubric_id: nil},
  {user_id: 224, question_id: 174, answer_text: " Con el nutriólogo y la plataforma de nutrición podremos ayudar a las personas a que generen educación en salud para mantener una comunidad con bajos indices de enfermedades como hipertensión, diabetes y obesidad, Debido a que el paciente no cumple con la dieta y el ejercicio durante los primeros abarcaremos Cambios Demograficos y sociales, Cambios en el poder economico mundial y Cambios tecnologico, ofreciendo Servicios web y Personalización constante\r\nSegún el contador de la página web del Programa Nacional de Cultura Física y Deporte 2014-2018, se han atendido a 871,363 mexicanos. Esto equivale sólo a 1.8% de los adultos con SPyObes y a 0.83% de la población objetivo\r\nEsto significa que sin un sistema que atienda los factores relacionados con la adherencia terapéutica, los adelantos en la tecnología biomédica no lograrán  reducir la carga de las enfermedades crónicas.” OMS\r\nEl paciente tendra que invertir 840 pesos en la prevención de enfermedades crónicas no transmisibles es costo-efectivo. Cecchini et al., 2010  \r\n\r\n \r\n\r\n", rubric_id: nil},
