  {user_id: 224, question_id: 144, answer_text: "Biomimética (de bios, vida, y mimesis, imitar) es una nueva ciencia que se basa en el estudio de los modelos, sistemas, procesos y elementos naturales con el propósito de imitarlos. La biomimética como se le conoce en la práctica,\r\nes un método por medio del cual los diseñadores e ingenieros hacen investigaciones biológicas con el propósito de determinar cómo los organismos resuelven problemas complejos.", rubric_id: nil},
  {user_id: 224, question_id: 150, answer_text: "La globalización es solo una de las dimensiones de entre muchas cosas fundamentales\r\nque están sucediendo en el mundo al día de hoy”\r\n\r\nLa globalización 3.0 está encogiendo al mundo\r\nllevándolo de ser pequeño a ser bien chiquitito al mismo tiempo que aplana el terreno de \r\njuego,   las fuerzas impulsoras del proceso  de  Globalización \r\n3.0 – y que es lo que le otorga su particular carácter – son individuos y pequeños grupos\r\nde individuos globalizándose. La Globalización  3.0 no  solo será  manejada más bien por  individuos que  por países o \r\ncompañías, sino que también por un cada vez mayor  y diverso grupo de individuos, no \r\nnecesariamente Occidentales y de piel Blanca o Rubios. En el proceso de Globalización \r\n3.0 veremos participando a todos los colores de la piel humana.", rubric_id: nil},
