  {user_id: 224, question_id: 147, answer_text: "El  Intraemprendimiento, es el acto de llevar adelante una actividad emprendedora al interior de una organización existente, con el fin de fomentar el empleo y la competitividad. Entonces, ¿en qué se parecen emprendedores e intraemprendedores? En su capacidad de asumir riesgos, en la orientación al logro, en la autoconfianza, en el enfoque en objetivos, en el trabajo en equipo y bajo presión, en el olfato para las oportunidades, en el compromiso con un objetivo común, en la perseverancia, en la organización y en la planificación", rubric_id: nil},
  {user_id: 224, question_id: 149, answer_text: "Posiciones políticas extremistas", rubric_id: nil},
  {user_id: 137, question_id: 153, answer_text: "El big data es el término que se le da al almacenamiento y análisis de una gran cantidad de datos para tener información valiosa que permita tomar mejores decisiones en los negocios.", rubric_id: nil},
