  {user_id: 137, question_id: 163, answer_text: "Mi idea de negocio surgió porque considero que el hogar es uno de los lugares más importantes en los que pasamos nuestras vidas, y cuándo me refiero al hogar, me gustaría ampliar el contexto y visualizarnos igualmente a nivel planeta, actualmente me dedico a la comercialización de muebles, pero al tiempo que trabajo para mejorar el espacio de una familia, en ese mismo momento estamos descuidando el bienestar del planeta, puesto que la fabricación de mobiliario consume recursos naturales que contribuyen a la deforestación y a la emisión de contaminantes, por lo que quiero ampliar la perspectiva e innovar con las nuevas tecnologías para crear un modelo en el cual se mejore la vida y el hogar de mis clientes, al mismo tiempo que cuido la sustentabilidad de mi planeta.", rubric_id: nil},
