  {user_id: 137, question_id: 168, answer_text: "Dato duro: 20%\r\nDescripción: sólo nos queda el 20 por ciento de los bosques primarios, aquellos donde nunca puso la mano el hombre\r\nFuente: http://www.ecologistasenaccion.org/article11730.html\r\nDato duro: 36 millones de m3r.\r\nDescripción: Las estimaciones para la tala clandestina, indican que el volumen de producción es de alrededor de 13 millones de m3r, mientras que el consumo de leña es estimado en cerca de 36 millones de m3r.\r\nFuente: http://www.fao.org/docrep/006/j2215s/j2215s04.htm\r\n", rubric_id: nil},
  {user_id: 241, question_id: 163, answer_text: "Investigando en Internet me di cuenta del daño que se causa por la contaminación y pase varios meses pensando en un proyecto para reducirla, llegue al tema de el PET y me di cuenta de todo lo que se puede hacer con el, pero ahora debía de pensar en como utilizarlo.\r\nA mi siempre me ha encantado la moda, y lei un estudio que los jóvenes gastamos la mayor parte de nuestro dinero en ropa y accesorios, desde ese momento me decidí a utilizar el PET para hacer accesorios.\r\n", rubric_id: nil},
