  {user_id: 241, question_id: 169, answer_text: "En México se desechan más de 90 millones de botellas PET al año, lo que representa del 30 al 45% de la basura generada a nivel mundial. \r\nDato duro: 30 al 45%\r\nDescripción: representa casi la mitad de basura a nivel mundial\r\nFuente: http://data.sedema.cdmx.gob.mx/educacionambiental/index.php/en/2016/cronica-de-un-residuo-pet-plastico-hasta-en-la-ropa", rubric_id: nil},
  {user_id: 241, question_id: 175, answer_text: "Bienestar: Reducir la contaminación reciclando.\r\nDato duro sobre bienestar: 7 millones de muertes cada año debidas a la contaminación atmosférica\r\nMegatendencias: Contaminación ambiental y falta de recursos.\r\nTendencia directa: Moda sostenible.\r\nTendencia indirecta: Reciclaje.\r\nDato duro sobre el problema que se busca solucionar: Solo el 15% de el PET se recicla.\r\nDato duro sobre el producto o servicio que se busca desarrollar: Accesorios para hombre y mujer.\r\nDato duro sobre el cliente al cual se quiere: Jóvenes de todo México de 16 a 27 años.\r\nAlcance: Nacional.", rubric_id: nil},
