  {user_id: 153, question_id: 141, answer_text: "Se puede decir que el crowdfunding es una forma de financiar un proyecto de manero colectiva pero al parecer se trata de mucho mas que eso, se trata de ver si en realidad tu idea les gusta a las personas y que estas la quieran adquirir aparte de que ellos tienen el control de opinar y hacer sugerencias sobre modificaciones que quieran en el producto.\r\n\r\nEl crowdfunding es de gran ayuda ya que por medio de el te puedes dar cuenta de si en realidad tu idea es tan buena como piensas o si tu idea es un fracaso para el mercado.  ", rubric_id: nil},
