  {user_id: 153, question_id: 144, answer_text: "La Biomimética es el estudio de todo lo creado por la naturaleza para tomarlo como ejemplo en las creaciones del ser humano, esto se hace debido a que la naturaleza a creado todo de una forma tan compleja a través de millones de años de evolución que prácticamente todo parece funcionar de manera perfecta, es por esto que si se toma como ejemplo todo lo creado por la naturaleza para las nuevas creaciones todo funcionara de una manera mas equilibrada y sustentable. ", rubric_id: nil},
