  {user_id: 144, question_id: 69, answer_text: "La innovación radica en la forma de obtener reportes financieros, métricos y estadísticas en las empresas, ahora en lugar de tener que tener a varios analistas copiando y pegando datos, ordenándolos, filtrándolos, etc. en hojas de cálculo, el usuario de la información financiera tendrá acceso a esa información a tiempo real con el simple hecho de buscarlo en su celular.\r\n\r\nTu negocio estará conectado contigo y tendrán una intima relación mediante equipos móviles.", rubric_id: nil},
  {user_id: 144, question_id: 71, answer_text: "El desarrollo económico será provocado por el crecimiento económico que un sistema de business Intelligence genera en las empresas, mis clientes tendrán menos mermas, serán más eficientes y más productivos, habrá un mejor monitoreo para incentivos al personal y la evaluación del desempeño serán rubros que le permitirán al empresario generar más dinero, con lo cual habrá, poco a poco, más inversión para el crecimiento de las empresas.", rubric_id: nil},
