  {user_id: 118, question_id: 69, answer_text: "La comida tradicional mexicana no tiene que estar peleada con lo saludable, es por ello que se pretende traer todos aquellos platillos típicos de manera saludable para que aquellas personas que cuiden de su salud puedan disfrutar de ellos.\r\n\r\nEn puebla no existe un servicio \"uberizado\" de motociclistas con reparto a domicilio, cada empresa costea sus propios servicios a domicilio. La implementación de un servicio de este tipo reduce costos de nomina y mantenimiento, ademas ello conduce a la especialización del servicio.", rubric_id: nil},
  {user_id: 170, question_id: 64, answer_text: "somos fabricantes, podemos dar atención personalizada, refacciones, asesoría, software, incluir mejoras a impresoras que ya se hayan adquirido, según e visto nuestros competidores se basan mucho en ventas por Internet, nosotros pretendemos establecernos en un lugar a donde el comprador también pueda ir y sentirse mejor atendido cuando lo haces frente a frente con una persona.  ", rubric_id: nil},
  {user_id: 170, question_id: 66, answer_text: "tenemos que ofrecer impresoras 3d con un precio justo tanto para el comprador como para nosotros ya que no es facial programar, armar, hacer funcionar una impresora 3d eficiente, es una industria muy reciente, nuestra combinación es buen precio con alta eficiencia.", rubric_id: nil},
