  {user_id: 130, question_id: 164, answer_text: "Es un proyecto que tiene mucho que ver con el medio ambiente, ya que convertimos un desecho contaminante en una materia prima que se reutilizara para generar otro producto o servicio.  ", rubric_id: nil},
