  {user_id: 130, question_id: 165, answer_text: "Este proyecto forma parte de Cambios Climáticos y Escasez de Recursos.\r\nYa que uno de los problemas más grandes de contaminación lo generan los neumáticos de desecho. Su material y masiva fabricación los convierten en un problema medio ambiental de primer orden en todo el mundo, pues no siempre se reutilizan.\r\nEn un estudio realizado por La Secretaría del Medio Ambiente del Distrito Federal nos comparte que los neumáticos usados, por lo general, se desechan de alguno de las siguientes formas: \r\n- Los mayoristas de servicio automotriz (generadores) contratan un servicio de recolección particular que las transporta hasta un almacén temporal, para posteriormente enviarlas a empresas que las utilizan como combustible alterno.\r\n- Los generadores minoristas utilizan el servicio de recolección pública de residuos.\r\n- Los generadores o transportistas también las echan indiscriminadamente en tiraderos a cielo abierto o en sitios clandestinos, lo que deriva en la disposición inapropiada y la acumulación no controlada.\r\n\r\nEn un estudio de 2011, dice que a esa fecha en México se generaban anualmente 25 millones de llantas, las cuales terminaban desechadas en cañadas, ríos, laderas de carreteras. Convirtiéndose al poco tiempo en generador de incendios no obstante a los aceites tóxicos que se desprenden y llegan a corrientes de agua o que se liberan al aire desprendiendo una serie de partículas dañinas para el ser humano.\r\nEs un problema que ya se ve muy evidente y del cual se puede hacer un gran negocio, ademas de un bien para la sociedad.     ", rubric_id: nil},
