  {user_id: 44, question_id: 64, answer_text: "Se parte de 3 principios:\r\n\r\n1. Calidad. Los productos tendrán la máxima calidad y frescura que se puede exigir a un vegetal, ya que el tiempo que transcurrirá entre su cosecha y su exhibición para venta en la tienda será mínimo, toda vez que las distancias el traslado son muy cortas debido a que todo se hace en la misma ciudad.\r\n\r\n2. Precio justo. Si bien los precios de los productos orgánicos son mayores a los de los productos tradicionales, se parte del principio de retribuir con justicia a las personas de la tercera edad que cultivaron dichos productos. Sin embargo los precios serán muy competitivos con los precios de los productos tradicionales. Al no haber más intermediarios entre el productor y el detallista más que la empresa, un porcentaje signficativo del precio del producto es para el agricultor.\r\n\r\n3. Producto con causa. Los consumidores directos y los detallistas estarán conscientes de que al comericalizar y consumir los vegetales de la empresa, estará apoyando a las personas de la tercera edad y también estarán apoyando al planeta a la producción orgánica que no agrede al medio ambiente.\r\n", rubric_id: nil},
