  {user_id: 44, question_id: 92, answer_text: "El cliente consumidor final tiene entre 18 y 60 años, nivel escolar mínimo de preparatoria y se preocupa por la salud y el medio ambiente, ubicándose en los segmentos socioeconómicos A, B, C+ y C.. Se informa de las características de los productos que consume y pide opinión a médicos, nutriólogos y otros líderes de opinión, siendo su familia y /o pareja su principal influencia para la toma de decisiones. Eventualmente los amigos pueden influirlo negativamente sobre la compra de productos orgánicos, criticando el precio más elevado que el resto de los otros productos, pero al mismo tiempo, el precio mayor puede significar para él un símbolo de estatus mayor.", rubric_id: nil},
  {user_id: 130, question_id: 169, answer_text: "- 100 millones de llantas en tiraderos en México http://www.borderlegislators.org/Meetings/XIX%20Tampico/Power%20Point%20Presentations/Edgar%20Del%20Villar%20Alvelais,%20SEMARNAT.pdf\r\n\r\n- 27 millones se desechan al año. Mercado formal. http://www.borderlegislators.org/Meetings/XIX%20Tampico/Power%20Point%20Presentations/Edgar%20Del%20Villar%20Alvelais,%20SEMARNAT.pdf\r\n\r\n- De los más de 28.5 millones de unidades desechadas cada año en México, el 91% termina en lotes baldíos, ríos, carreteras, etcétera. Dicha situación no sólo arruina nuestros paisajes, sino que también ocasiona severos daños en los ecosistemas y en nuestra salud. http://hometech.com.mx/llantas-usadas-un-gran-problema-de-contaminacion/", rubric_id: nil},
