  {user_id: 130, question_id: 163, answer_text: "Mi idea de negocio surgió cuando en una platica que tenía con un amigo me comentó que tenia varios conocidos en la industria de Autotransportes (Dueños, hijos de dueños y accionistas de compañías fleteras) que le proporcionaban las llantas usadas que ya iban a desechar, para que las vendiera y la empresa le pudiera sacar algo de dinero extra y mi amigo por hacer su labor de venta también. \r\nNos movimos con gente chatarrera y nadie nos quiso comprar llantas usadas.\r\nFinalmente nos hicimos a la tarea de investigar como podíamos cubrir ese sector, elaborando una planta de reciclado de llanta que pueda convertir un desecho en materia prima que le sirva a alguna otra industria. Es un mercado que se puede explotar de gran manera, es un sector que beneficia al medio ambiente, la materia prima tendría un costo muy mínimo y finalmente nuestro producto terminado es materia prima para otros sectores e industrias.    ", rubric_id: nil},
