  {user_id: 130, question_id: 167, answer_text: "- Se espera que para el año 2017, 10% por ciento de la energía producida en el país sea de fuentes renovables particulares. http://www.promexico.gob.mx/desarrollo-sustentable/energias-alternativas-en-mexico.html\r\n\r\n- Para 2026 se espera que la capacidad adicional instalada con energías renovables y grandes hidroeléctricas sea de 18,505 MW, 20,545 MW y 22,788 MW en los escenarios bajo, de planeación y alto, respectivamente. De dicha capacidad, 39.7% corresponde a\r\nservicio público, 49.8% a autoabastecimiento y 10.5% a generación distribuida de pequeña, mediana y gran escala. https://www.gob.mx/cms/uploads/attachment/file/62954/Prospectiva_de_Energ_as_Renovables_2012-2026.pdf\r\n", rubric_id: nil},
