  {user_id: 130, question_id: 170, answer_text: "- Los residuos, fuentes de energía alternativas al petróleo [...] Olazar ha desarrollado dos líneas, según el tipo de residuo: una utiliza la biomasa; la otra, plásticos, neumáticos y residuos similares. La primera de las líneas utiliza residuos agrícolas y biomasa procedente de los bosques. Según Olazar, el 70 % de la masa tratada puede ser convertida en bioaceite, “lo que significa que si tratamos una tonelada de biomasa, obtenemos unos 700 litros de bioaceite”, afirma. http://www.interempresas.net/Reciclaje/Articulos/129049-Los-residuos-fuentes-de-energia-alternativas-al-petroleo.html\r\n\r\n- Se instalarán plantas recicladoras de llantas [...] Recuperación de materiales y desarrollo de nuevos productos [...] Aprovechamiento de valor calorífico. http://www.borderlegislators.org/Meetings/XIX%20Tampico/Power%20Point%20Presentations/Edgar%20Del%20Villar%20Alvelais,%20SEMARNAT.pdf\r\n\r\n- Su composición después de su vida útil es, aproximadamente, un 80% caucho, 15% acero y 5% nylon y, debido a su estabilidad química, se estima que tienen una lenta degradación de unos 600 años. http://www.ceamse.gov.ar/reciclaje/planta-de-procesamiento-de-neumaticos/", rubric_id: nil},
