  {user_id: 44, question_id: 66, answer_text: "La empresa es la combinación de un servicio de proveeduría y asesoría para que los agricultores urbanos puedan cultivar en sus casas y posteriormente un proceso de recolección, empaque y comercialización de los mismos productos.\r\n\r\nLos agricultores urbanos de la tercera edad trabajarán en los invernaderos hidropónicos instalados en sus casas, recibiendo asesoría de la empresa para el cultivo de los vegetales orgánicos y posteriormente la empresa recolectará la cosecha. \r\n\r\nLa empresa empacará y comercializará los productos en tiendas de autoservicio, tiendas especializadas y tiendas gourmet, así como en restaurantes gourmet.\r\n\r\nLa clave  para el éxito de la empresa será una correcta ejecución de los cultivos, logística para su recolección y empaque, para que lleguen frescos y a tiempo para su comercialización.\r\n\r\nLa empresa tendrá tres características principales que la diferenciará de sus competidores:\r\n\r\n1. Calidad. Los productos tendrán la máxima calidad y frescura que se puede exigir a un vegetal, ya que el tiempo que transcurrirá entre su cosecha y su exhibición para venta en la tienda será mínimo, toda vez que las distancias el traslado son muy cortas debido a que todo se hace en la misma ciudad.\r\n\r\n2. Precio justo. Si bien los precios de los productos orgánicos son mayores a los de los productos tradicionales, se parte del principio de retribuir con justicia a las personas de la tercera edad que cultivaron dichos productos. Sin embargo los precios serán muy competitivos con los precios de los productos tradicionales. Al no haber más intermediarios entre el productor y el detallista más que la empresa, un porcentaje significativo del precio del producto es para el agricultor.\r\n\r\n3. Producto con causa. Los consumidores directos y los detallistas estarán conscientes de que al comercializar y consumir los vegetales de la empresa, estará apoyando a las personas de la tercera edad y también estarán apoyando al planeta a la producción orgánica que no agrede al medio ambiente.", rubric_id: nil},
