  {user_id: 121, question_id: 147, answer_text: "Intraemprendimiento se refiere a la cualidad que poseen algunos colaboradores de desarrollar una idea de negocio, y de esta manera innovar ya sea en el producto o en el servicio que ofrece la empresa donde laboran. Para esto es indispensable que se dé la oportunidad a los colaboradores de implementar nuevas ideas y llevarlas a cabo.\r\n\r\nEmpieza en el momento en que un colaborador detecta necesidades, y las ve como oportunidad de negocio o mejoría. Dichas necesidades  pueden ser externas o internas. Las primeras dan solución a necesidades de los clientes, mejorando en productos o servicios. Las segundas dan solución a necesidades del personal laborando en la empresa, mejorando sobre todo en el servicio. ", rubric_id: nil},
  {user_id: 121, question_id: 148, answer_text: "Enfermedades", rubric_id: nil},
  {user_id: 121, question_id: 149, answer_text: "Acceso a la tecnología", rubric_id: nil},
  {user_id: 139, question_id: 94, answer_text: "Clases innovadoras que sean una experiencia sensorial.", rubric_id: nil},
  {user_id: 139, question_id: 77, answer_text: "Servicios de educación y salud", rubric_id: nil},
  {user_id: 44, question_id: 71, answer_text: "La empresa es innovadora principalmente en los grupos destinatarios del beneficio de obtener un trabajo remunerado, ya que si bien las personas de la tercera edad serán los principales beneficiarios, también podrán participar personas con ciertas limitaciones motrices y personas que, sin ser de la tercera edad o con limitaciones físicas, podrán instalar un invernadero en sus hogares para proveer o mejorar sus ingresos familiares o comunales. Simplemente deberán contar con el espacio, el tiempo y la conexión a internet.\r\n\r\nTal es el caso de amas de casa sin empleo remunerado, personas desempleadas, conventos, orfanatos, etc.\r\n\r\nEl proceso del ciclo producción-distribución también es innovador debido a que los agricultores urbanos se encontrarán en la misma localidad física que los consumidores finales, considerando que ambos vivirán en la misma ciudad.\r\n\r\nEl proyecto está diseñado para generar un impacto en áreas múltiples:\r\n\r\nEn el aspecto social, contribuye a generar bienestar en la población de la tercera edad, de personas con limitaciones físicas, de personas desempleadas y de otros grupos vulnerables, de una manera productiva, no asistencialista, pues las personas generarán sus propios ingresos mediante un trabajo útil para el medio ambiente, para su comunidad y para sí mismos\r\n\r\nAl sentirse útiles estas personas, el impacto en su autoestima, en su bienestar económico y en su entorno, repercutirá positivamente en su autoimagen general y en su salud mental. El adquirir una nueva habilidad y que ésta sea compartida con un grupo de agricultores urbanos iguales que él, le generará un sentido de pertenencia a un grupo.\r\n\r\nEs evidente que al generar ingresos por una actividad productiva, también generarán consumo y pago de impuestos, al desarrollo económico general.", rubric_id: nil},
