  {user_id: 172, question_id: 16, answer_text: "Actualmente se cuentan con 30 estructuras en arte urbano que funcionan como aparca bicicletas en Tlajomulco en las que se pueden encadenar 180 bicicletas de las cuales 20 forman una ruta ciclista turística de Guadalajara a la laguna de Cajititlán, pero las autoridades no han explotado esa opción de turismo ecológico adecuando alguna ciclovía ni tampoco me han permitido refrendar las licencias permanentes de los 30 anuncios con lo cual la inversión de $600,000.00 MN está detenida. Por otra parte, la mayoría de la gente no ve al ciclista como posible cliente de su negocio puesto que tiene la creencia de que sus clientes cuentan con automóvil propio, pero en Jalisco se acaba de aprobar una Bici-Ley en Octubre 2016 la cual por los estacionamientos públicos también deberán contar con estacionamientos para bicicletas. Y tengo previsto formar una Asociación Civil ecológica para ayudar a satisfacer las necesidades de la gente que no les sea posible invertir como empresa socialmente responsable les podremos ayudar.", rubric_id: nil},
  {user_id: 239, question_id: 12, answer_text: "El comercio en una gama de mercancía de alto costo es de muy difícil acceso para personas de clase media ", rubric_id: nil},
  {user_id: 198, question_id: 13, answer_text: "México es uno de los mejores lugares para invertir en servicios de contacto al cliente por parte de empresas extranjeras, dada a su ubicación geográfica (vecino de USA) y su mano de obra barata. El 27% del 36% de las empresas de éste rubro, se localizan aquí. Pero el servicio es siempre el mismo. Se ha detectado un aumento en la insatisfacción en la experiencia que vive el usuario/consumidor al tratar de comunicarse al centro de contacto de su empresa de consumo. Y es que 87% de las personas que usan éstos servicios, creen de manera rotunda que el servicio que se les ha brindado es malo. Las personas prefieren no tener que esperar a escuchar un sin fin de menús grabados con opciones ni desperdiciar mas tiempo del que se debe para resolver sus dudas/problemas ni mucho menos, dinero. El problema radica en la búsqueda principalmente de un número de contacto (01800-900), después en la espera que toma para el usuario el ser conectado con un asesor a base de las múltiples opciones que brinda el sistema (si hay la opción de ser transferido con un asesor y, tercera, obtener un servicio de mala calidad. ", rubric_id: nil},
