  {user_id: 159, question_id: 13, answer_text: "Como ejemplo podemos decir que solo el 9.2% de la población han sido diagnosticados con diabetes, el número exacto de mexicanos diagnosticado no puede ser exacto ya que algunas personas no saben que tienen esta condición. La cifra de diagnóstico previo aumenta después de los 50 años.\r\nLos estados con prevalencias más altas son: Distrito Federal, Estado de México, Nuevo León, Veracruz, Tamaulipas, Durango y San Luis Potosí.\r\nAsí como esta condición existen otras que son detectadas con la ayuda del laboratorio de análisis clínicos.", rubric_id: nil},
  {user_id: 159, question_id: 14, answer_text: "Servir al público en general con análisis clínicos para la prevención, diagnostico y monitoreo de algunas enfermedades.", rubric_id: nil},
  {user_id: 159, question_id: 17, answer_text: "1) En algunas ocasiones su médico le solicitará análisis de laboratorio para brindarle un diagnostico fidedigno.\r\n2) Para algunos tramites es necesario conocer su grupo sanguíneo.\r\n3) Al momento de contraer nupcias les serán solicitados analisis prenunciales.\r\n\r\nEstos son solo unos ejemplos, donde al no satisfacer esta necesidad no podrán avanzar en sus procesos.\r\n ", rubric_id: nil},
  {user_id: 172, question_id: 12, answer_text: "Porque las contaminaciones dañan nuestra calidad de vida. ¿Sabías? que según varios estudios, por cada persona es necesario que haya por lo menos de cuatro árboles maduros para respirar. En la ZM de Guadalajara tenemos congestionamiento vehicular, saturación de vehículos, saturación de rutas del transporte público, contaminación auditiva y deterioro del medio ambiente. En 2015 Autoridades de ZM de Guadalajara (MC) señalaron el daño ambiental de espectaculares porque son elementos que crean contaminación visual en la ciudad, pero no impidieron que continúen contaminando la ciudad, ni talando árboles, tampoco se animaron a prohibir la colocación de más de estas estructuras en la ciudad. Urgen Acciones contra el cambio climático, las contaminaciones ambientales, visuales y auditivas. De continuar así el mundo se vuelve cada vez más frágil, así pues, habrá un mayor calentamiento, que provocará un efecto amplificador, los humanos hemos creado un calentamiento brusco que parece va a continuar de no corregir el rumbo.", rubric_id: nil},
  {user_id: 159, question_id: 19, answer_text: "Una sola vez", rubric_id: nil},
  {user_id: 172, question_id: 13, answer_text: "El 21 de Octubre la Semarnat aprueba la tala comercial de 33% del bosque del Nevado de Toluca, pero en todo México es incontrolable la tala ilegal como legal, porque a pesar de que se toman medidas de reforestación en las talas controladas no se reponen los árboles talados en comparación con la supervivencia de los recién plantados. Por ejemplo, en México ocurren en promedio, 35 mil accidentes de motocicleta al año; en febrero del 2015 en Guadalajara se perdía el 33.24 por ciento del traslado ya que a lo largo del año los conductores tienen que parar y avanzar 24,840 veces. ¿Sabías? que el 40% de los viajes en la ciudad son de menos de 15 minutos y menos de ocho kilómetros de distancia. ¿Sabías? que la velocidad en las horas pico en la Cd. de México se estima en 14 km/hr. ¿Sabías? que la velocidad promedio de una bicicleta en la ciudad es de 16.4 km/hr. \r\n¡Es urgente que todos tomemos medidas para que cada vez usemos menos los vehículos automotores y mejor utilicemos más la bicicleta, el transporte no motorizado y los vehículos eléctricos!", rubric_id: nil},
