  {user_id: 172, question_id: 11, answer_text: "A todo el mundo, pero se refleja más que afecta a los niños y adultos mayores. La OMS calcula que cada día mueren 19 mil 178 personas por enfermedades relacionadas a la contaminación del aire. Actualmente, 15 mil 300 millones de árboles son talados cada año, es decir, 485.2 árboles c/segundo, sólo en México se pierden poco más de 90 mil hectáreas boscosas por año. México está en el Top 10 de accidentes de tránsito. Ya en Febrero del 2015 Guadalajara era la novena peor ciudad del mundo para manejar.", rubric_id: nil},
