  {user_id: 239, question_id: 15, answer_text: "Sí", rubric_id: nil},
  {user_id: 172, question_id: 17, answer_text: "Además de bajar nuestra calidad de vida, el aumento del estrés incrementando las enfermedades mentales y los suicidios, saturación del aire que respiramos con partículas dañinas para nuestra salud, aumento de la contaminación ambiental, visual y auditiva, sobre peso que lleva a enfermedades cardiacas y diabetes, además el aumento de la temperatura también produce un aumento de la temperatura en mares y océanos que afecta negativamente a los ecosistemas marinos. También hay que tener en cuenta las posibles consecuencias que podría llegar a tener el calentamiento global, caso de inundaciones, temporales y tormentas tropicales. Sequías, huracanes, hambre, pobreza y destrucción: estas son algunas de las terribles consecuencias que el calentamiento global provoca en nuestro planeta. Y en nuestra mano está participar activamente para frenar sus efectos si queremos que las siguientes generaciones hereden un mundo tal y como lo conocemos hoy. O mejor. Qué consecuencias tiene el calentamiento global\r\n1. Temperaturas más cálidas 2. Tormentas más intensas 3. Propagación de enfermedades 4. Olas de calor más fuertes 5. Derretimiento de los glaciares 6. Huracanes más peligrosos 7. Cambio de los ecosistemas 9. Aumento del nivel del mar 10. Alimentos más caros \r\nEs necesario empezar a poner las bases de un futuro más sostenible. Entre todos podemos conseguirlo. ¡Pero no hay tiempo que perder! ¿Nos ponemos ya en marcha?", rubric_id: nil},
