  {user_id: 239, question_id: 22, answer_text: "Cubrir la necesidad de vestimenta con ropa de calidad y aun costo bajo para cubrir el presupuesto de las personas sin afectar su economía y sobre todo vestir a la moda y con poco dinero", rubric_id: nil},
  {user_id: 172, question_id: 92, answer_text: "El comprador del servicio no es el usuario, si no los clientes del negocio en el que trabaja el comprador, la educación familiar influye si cuenta con valores ecológicos o no. Y los medios informativos influyen la conciencia de la gente.", rubric_id: nil},
