  {user_id: 172, question_id: 18, answer_text: "Me faltan recursos económicos para:  1.- Poder fabricar e instalar más estructuras para no depender de que se destrabe las que no permiten refrendar, recursos para reforestar y mantener árboles.  2.- Lanzar una campaña publicitaria de conciencia de la problemática en la cual solicitamos la ayuda inicial de los empresarios para instalar aparca bicicletas en sus negocios y concientizar a la gente del uso de la bicicleta. Incrementando las ventas de estructuras 3.- Se darán cursos ecológicos.  4.- Crear vínculos con los gobiernos para crear andadores para peatones y ciclistas, reforestando y mejorando los espacios públicos que atraerá al turismo (ejemplo: Recorrido a pie por la Barcelona modernista y de Gaudí).  5.- Mantenimiento y mejoraremos de las zonas lúdicas. Creación de aplicaciones ciclistas.", rubric_id: nil},
