  {user_id: 206, question_id: 150, answer_text: "la globalizacion 3.0 no solo se refiere a tener al alcance cualquier cosa que se desee de cualquier parte del mundo, tampoco es hablar ingles para comunicarse con cualquier persona en el mundo, va mas haya de las ateriores globalizaciones donde significaba conectar dos puntos en distintas partes del mundo.\r\nImplica que los modelos actuales economicos, financieros, educativos, polticos no se renuevan, se romperan ante la presion ejercida por ser humano actual, refieriendome al que esta conectado y al tanto de las tendencias y megatendencias, hoy en dia cualquier persona puede iniciar un cambio que el dia de mañana quebre imperios economicos mundiales.\r\nEntender la fuerza con la que las personas cuentan hoy en dia, apoydos por las tecnologias y los sistemas que las grandes empresas y gobiernos ayudaron a construir, es crucial para el desarrollo del emprendedor actual.", rubric_id: nil},
