  {user_id: 172, question_id: 69, answer_text: "El servicio y producto es innovador porque es mobiliario en arte urbano que funciona como aparca bicicletas en las que se renta espacios para publicidad; adapta el arte urbano con la marca de la compañía o con la campaña publicitaria o con el giro de la empresa. Reforesta y mantendrá dichos árboles. Las zonas lúdicas no existen, recuperación del espacio público sin costo para el ayuntamiento ni para la gente, donde se contempla que la electricidad sea generada por panel solar para iluminación nocturna, con un sistema de seguridad que funcione con un candado, sistema de video vigilancia con una aplicación para contar usuarios, red de WiFi gratuita, con sockets para recargar celulares y algún juego interactivo por medio de bicicletas fijas con mejoramiento continuo sin necesidad de inversión debido a que los recursos saldrán de la renta de la publicidad. Es un proyecto multidisciplinario auto sustentable.", rubric_id: nil},
