  {user_id: 229, question_id: 147, answer_text: "El intraemprendimiento se trata de emprender en un nuevo proyecto dentro de una empresa ya existente, con la finalidad de crecer, innovar, ofrecer un nuevo producto o un nuevo servicio.  El intraemprendimiento y el emprendimiento tienen muchos rasgos en común, lo único que los distingue es que los emprendedores inician de cero y en el intraemprendimiento ya se tiene la base de una empresa formada.", rubric_id: nil},
  {user_id: 154, question_id: 10, answer_text: "Abastecimiento eficiente derivado del acero ", rubric_id: nil},
  {user_id: 38, question_id: 141, answer_text: "El crowdfunding se define como la financiación colectiva de proyectos a través de Internet. Esta herramienta que actualmente se utiliza ya en muchos productos y servicios permite al donante sentirse parte importante en el producto o servicio convirtiéndose en los primeros compradores potenciales.\r\n\r\nEn todos los casos que menciona la nota se puede apreciar  al crowdfunding como una nueva herramienta colaborativa que permite exponenciar la forma de interrelacionarse con personas que por medio de la unidad colectiva permiten la creación de proyectos con alto impacto.", rubric_id: nil},
  {user_id: 130, question_id: 11, answer_text: "Tiene graves consecuencia para la salud pública y también para el medio ambiente, en especial a los que se encuentran cercanos a tiraderos de neumáticos. Entre las zonas más afectadas del país se encuentra: Baja California, Chihuahua, Sonora y Coahuila.  ", rubric_id: nil},
  {user_id: 130, question_id: 12, answer_text: "- En la combustión de los neumáticos se generan productos muy perjudiciales para la salud como son el monóxido de carbono, óxidos de nitrógeno, dióxido de carbono, óxidos de zinc, benceno, fenoles, óxidos de plomo o tolueno, que se dispersan en el aire. Estos efectos insaludables pueden probocar irritación de la piel, ojos, y membranas mucosas, depresión del sistema nervioso central, efectos respiratorios, y cáncer. (Sin entrar en tipos de contaminantes y partículas que se desprenden) \r\n- Un neumático al aire libre va librando muy lentamente los contaminantes, como son los bifenilos policlorados (PCB), tóxicos muy peligrosos. Otro de los riesgos de los neumáticos tienen que ver con su forma. Debido al diseño de los neumáticos, cuando cae agua de lluvia reiteradamente es dificilísimo sacarla una vez que ha entrado en él y siempre quedará un fondo dentro de la cubierta. Ese agua es el caldo de cultivo ideal para que aniden ratas, insectos  y otros animales dañinos que pueden resultar cuatro mil  veces más peligrosos de los que se multiplican en una charka.\r\n\r\nFuente 1: http://www.elpinerodelacuenca.com.mx/epc/index.php/politica/23000-neumaticos-ruedas-imparables-de-contaminacion\r\nFuente 2: https://www3.epa.gov/ttn/catc/dir1/tire_esp.pdf\r\nFuente 3: http://www.abc.es/sociedad/abci-combustion-neumaticos-genera-microparticulas-cancerigenas-para-humano-201605131305_noticia.html\r\n\r\n", rubric_id: nil},
  {user_id: 191, question_id: 71, answer_text: "Generación de empleos e indirectos apoyando a productores de malta base de la región y generando empleos mas dignos y de calidad para el desarrollo de la ciudad de Morelia, Michoacán", rubric_id: nil},
