  {user_id: 130, question_id: 13, answer_text: "Los ciudadanos y ecosistemas cercanos a los tiraderos de llantas usadas, mencionando Baja California, Chihuahua, Coahuila y Sonora como los lugares mayormente afectados del país, presentan contaminación por la combustión y abandono de neumáticos usados. Generando gases tóxicos que dañan al ser humano y provocan: irritación de la piel, ojos, y membranas mucosas, depresión del sistema nervioso central, efectos respiratorios, y cáncer.    ", rubric_id: nil},
