  {user_id: 172, question_id: 81, answer_text: "Están las eco bicis, que rentan la bicicleta mediante el pago de una anualidad. Están las renta de espectaculares, parabuses, etc. Están las campañas de gobierno para adoptar un árbol.", rubric_id: nil},
  {user_id: 172, question_id: 84, answer_text: "Un espectacular en la ZM de Guadalajara ronda los 27 mil a 54 mil mensuales, un para-bus lo rentan en 24 mil mensuales. La eco-bici la rentan en 365 pesos anuales (más recargos) En el programa Mi Bici para 2 mil bicis y 236 estaciones se gastaron en dos etapas 312 millones de pesos, más el gasto mensual del mantenimiento, aproximadamente 36 millones 266 mil 667 pesos. Es decir en dos años de programa van 348 millones 266 mil 667 pesos. Las campañas de reforestación son varios millones de pesos (a la gente no le cuestan directamente nada) solo en el 2009 se aprobaron para Semarnat 47 mil 226 millones de pesos, mientras que para el 2010, el Ejecutivo propuso 40 mil 485 millones de pesos.", rubric_id: nil},
  {user_id: 172, question_id: 85, answer_text: "En la instalación de 30 aparca bicicletas conseguí una inversión de $600,000 donde se plantaron 13 árboles (porque en las estaciones no estaba la opción de plantar árbol o ya había un árbol) que mensualmente sin más inversión pudiera crecer la red en un 10%, manteniendo y cuidando los espacios públicos, el mejoramiento de las zonas lúdicas sería un poco más lento pero mensualmente avanzaría (colocar el sistema de seguridad, instalar un techo, iluminación nocturna led, etc, etc) conforme se rentan los espacios publicitarios.", rubric_id: nil},
  {user_id: 202, question_id: 13, answer_text: ".", rubric_id: nil},
  {user_id: 172, question_id: 86, answer_text: "Voy a utilizar como ejemplo la inversión del programa Mi Bici 348'266,667 pesos, se pudieran instalar 17,413 aparcabicicletas y 17,413 árboles plantados, en las que se encadenarían 104,480 bicicletas. Con 17,413 anuncios rentados. Solución del problema a gran escala.", rubric_id: nil},
