  {user_id: 172, question_id: 87, answer_text: "Se rentaría cada anuncio en $4,500 de donde se destinarían recursos para el mantenimiento de las zonas lúdicas y el cuidado de los árboles plantados. Inversión por cada estación inicial 18,000 una vez completada sería aproximadamente de unos 50,000 Todo dependerá de las cantidades a instalar.", rubric_id: nil},
