  {user_id: 172, question_id: 164, answer_text: "Medio ambiente, compromiso cívico, comunidad y salud: Sin aire no hay vida. Reforestando mejoraremos el aire que respiramos, bajaremos el calentamiento. Transportándonos en bicicleta ejercitaremos bajando de peso (se crean endorfinas) mejorando nuestra salud, mental y física. Se crearán empleos (con un balance de trabajo-vida, está comprobado que una persona debe de tener tiempo para trabajar, tener calidad de vida con su familia, convivir con amigos, tener tiempo para él mismo y descanso es una persona que produce más, lo cual genera la satisfacción ante la vida) se generarán ingresos (impuestos, pago de permisos y licencias) y seguridad tanto en el trabajo como el cada estación de las zonas lúdicas.", rubric_id: nil},
  {user_id: 206, question_id: 161, answer_text: "La deforestación\r\nEmisión de gases de efecto invernadero por combustibles fósiles no renovables\r\nLa creación de una ley de transición energética", rubric_id: nil},
