  {user_id: 121, question_id: 165, answer_text: "Entra dentro de la categoría de cambios demográficos y sociales ya que se pretende mitigar el problema de enfermedades debidos a malos hábitos alimenticios y sedentarismo.", rubric_id: nil},
  {user_id: 172, question_id: 82, answer_text: "En lo que es la renta de bicicletas en el DF (que es el programa con más usuarios y viajes al día) solo el 10% de la gente que utiliza la bicicleta como medio de transporte las renta, es decir, el 90% de la gente que utiliza la bicicleta es con su propia bicicleta. Además que tienes poco tiempo para trasladarte y llegar a la estación de lo contrario te cobran más dinero. No llegas directamente al establecimiento al que te diriges. Necesitas tarjeta de crédito para poder ingresar al programa. Además mensualmente cuesta millones el mantenimiento, del erario público.\r\nEn lo de los anuncios publicitarios son rectangulares, la gente no voltea a verlos, además de que talan los árboles y generan contaminación visual.\r\nEn lo del programa de adopta un árbol, la mayoría de los árboles mueren, porque la gente no los cuida, y si reforestan en un bosque, está la tala de árboles la cual avanza más rápido que la cantidad de árboles que puedan sobrevivir al ser plantados sin tener quien los cuide, recién en Octubre 2016 Semarnat acaba de autorizar la tala legal del 33% del bosque en el nevado de Toluca, el año pasado se perdieron 90 hectáreas de bosques en México.", rubric_id: nil},
