  {user_id: 172, question_id: 169, answer_text: "Actualmente \"sólo\" se pierden en Máxico poco más de 90 mil hectáreas por año (Pacchiano - Semarnat) http://www.informador.com.mx/3417/tala-de-arboles\r\n\r\nActualmente, 15 mil 300 millones de árboles son talados cada año en el mundo. https://es.mongabay.com/2015/09/cuantos-arboles-son-talados-al-ano/\r\n\r\nLa reforestación debe ser continua.", rubric_id: nil},
  {user_id: 301, question_id: 11, answer_text: "De acuerdo con el Instituto Nacional de Estadística, Geografía e Informática (INEGI), en México hay más de 20 millones de adolescentes que representan el 22% de la población del país. De esta cifra, casi la mitad está entre los 15 y los 19 años.   Este nicho se caracteriza por una constante preocupación por el futuro y por la identidad que se está formando: educación y futura profesión, relaciones interpersonales, sexualidad, música y salud, entre otros temas. En este contexto, las marcas adquieren una importancia sustancial, llegando al grado de que los jóvenes se \"apropian\" de ellas para definirse a sí mismos.   Los jóvenes decoran sus páginas personales con logotipos de marcas, caricaturas, música, fotos de actores o actrices e intereses personales. Es como asomarse a sus recámaras para ver qué cuelga de las paredes. El ejercicio da una radiografía de sus gustos, preferencias, modas y hábitos de consumo.   En cuanto a su aspecto físico, buscan verse bien. Hacen ejercicio, aunque no necesariamente cuiden su alimentación. Por lo general, buscan productos que les proporcionen un sentido de autenticidad. Les gusta sentirse originales y tomados en cuenta.   Saben utilizar la tecnología y se acompañan de ella en todo momento. La utilizan para sus obligaciones escolares, para su diversión y como herramienta de comunicación entre ellos.", rubric_id: nil},
  {user_id: 172, question_id: 170, answer_text: "En el 2009 BKT había instalado 200 ciclopuertos, inversión hecha por el ayuntamiento de Guadalajara de 350 mil pesos en la compra e instalación de los ciclopuertos ($1,750.00 c/u IVA inc.), se contaban unos 74 mil usuarios por día. La meta es implementar la bici como un medio de transporte cotidiano... http://www.informador.com.mx/jalisco/2009/128329/6/guadalajara-pedalea-hacia-una-movilidad-alternativa.htm", rubric_id: nil},
  {user_id: 301, question_id: 12, answer_text: "bueno la búsqueda de identidad en los jóvenes, es un tema abordado por varios autores y desde muchas ópticas pero son todos rios que confluyen en un mismo gran mar por que realmente todas las explicaciones dan similares explicaciones. Una de las características presentes en todos los seres humanos pero que se ven reflejadas con mayor intensidad en la juventud es la búsqueda constante de desarrollar su identidad, \"¿Quién soy?\"\r\nEn esta búsqueda de identidad buscan expresar elementos que los definan a través de la unión con otros jóvenes en grupos de determinadas características comunes, la música, las películas o la moda por citar solo algunas.\r\nAsí pues tener a la mano una manera eficaz y eficiente de captar toda esta búsqueda de autonomía e identidad, a través de elementos que expresen lo que son y sienten les sera de gran ayuda", rubric_id: nil},
