  {user_id: 172, question_id: 171, answer_text: "Aprueban ‘Biciley’ en Jalisco. articulo 12 ter. Las autoridades encargadas de la administración de edificios públicos estatales o municipales gestionarán que en los mismos se realicen las modificaciones necesarias para contar con lugares seguros, suficientes y preferenciales para el estacionamiento de bicicletas conforme a la norma técnicas y demás disposiciones legales aplicables. http://congresoweb.congresojal.gob.mx/bibliotecavirtual/legislacion/Leyes/Ley%20de%20Movilidad%20y%20Transporte%20del%20Estado%20de%20Jalisco.doc\r\n\r\nCódigo urbano para Jalisco, Art. 223 Las garantías mínimas de acceso y bienestar con las que deben adecuarse las edificaciones y espacios abiertos tanto públicos como privados son las siguientes, las cuales estarán contenidas en los reglamentos municipales: I. Estacionamientos para vehículos y bicicletas; Art 237 Las acciones materiales relativas a las obras de urbanización, comprenden: III. Los elementos de la vialidad, como calles, banquetas, andadores, ciclovías, estacionamiento para vehículos y para bicicletas, los dispositivos de control vial, como señalización y semaforización con sus equipos e instalaciones, y los elementos e instalaciones para la operación del transporte colectivo;  https://www.google.com.mx/url?sa=t&rct=j&q=&esrc=s&source=web&cd=1&cad=rja&uact=8&ved=0ahUKEwjjobT3zdTQAhUOx2MKHWMCBD0QFggZMAA&url=http%3A%2F%2Fcongresoweb.congresojal.gob.mx%2Fbibliotecavirtual%2Flegislacion%2FCodigos%2FC%25C3%25B3digo%2520Urbano%2520para%2520el%2520Estado%2520de%2520Jalisco.doc&usg=AFQjCNH2XgnvvJSzEhzm_1WaQ8UkUInXDw&sig2=ebgsrwGQ7cSgHBH2ag9jEQ\r\n\r\nEn 2009 Se contaban unos 74 mil usuarios por día. La meta es implementar la bici como un medio de transporte cotidiano... http://www.informador.com.mx/jalisco/2009/128329/6/guadalajara-pedalea-hacia-una-movilidad-alternativa.htm", rubric_id: nil},
