  {user_id: 172, question_id: 165, answer_text: "Cambios climáticos y escasez de recursos: al reforestar se mejora el medio ambiente en general, dependemos de los árboles para respirar mejor y tener una mejor temperatura.\r\nUrbanización acelerada: por lo general no hay planeación urbanística, hasta hace un mes se acaba de reglamentar incluir estacionamientos para bicicletas en estacionamientos para carros, tampoco se planea las obras de infraestructura para el transporte por todos los medios (peatonal, bicicleta, automóvil, de carga, silla de ruedas, etc) por eso nuestra meta final es lograr tener andadores peatonales y ciclistas arbolados comenzando con una distancia a cada 10 cuadras, posteriormente a cada 5 cuadras. \r\nAvances tecnológicos: porque en las estaciones lúdicas instalaré panel solar, video vigilancia, se crearán aplicaciones para los ciclistas y juegos lúdicos que por medio de pedalear una rueda esa energía sea aprovechada.\r\nEn general es un concepto de mejora continua y puede abarcar los cambios demográficos y sociales entre los 3 puntos arriba expuestos.", rubric_id: nil},
