  {user_id: 74, question_id: 36, answer_text: "Adultos de género indistinto con un rango de edad de 30 a 34 años que tienen un empleo, son auto-empleados o dueños de un negocio/empresa. Principalmente ubicados en la Ciudad de México y ciertas zonas del Estado de México; municipio de Huixquilucan y Naucalpan; cuyo nivel socioeconómico es C y C+.", rubric_id: nil},
  {user_id: 301, question_id: 13, answer_text: "De acuerdo con el Instituto Nacional de Estadística, Geografía e Informática (INEGI), en México hay más de 20 millones de adolescentes que representan el 22% de la población del país. De esta cifra, casi la mitad está entre los 15 y los 19 años. Este nicho se caracteriza por una constante preocupación la identidad, por lo que buscan constantemente maneras de expresarla y así poder definirse y expresar como piensan y sienten.\r\n\r\n", rubric_id: nil},
  {user_id: 172, question_id: 175, answer_text: "Bienestar: Cambio Climático y Urbanización Acelerada.\r\nDato Duro: Cada segundo 485 árboles son talados en el mundo.\r\nMega tendencias: Cambios demográficos.\r\nTendencia Directa: Smart Cities.\r\nTendencia Indirecta: Modelos sustentables con energías alternativas.\r\nDato Duro sobre el Problema a Solucionar: Actualmente \"sólo\" se pierden en México poco más de 90 mil hectáreas por año\r\nDato Duro sobre el producto o servicio que se busca desarrollar: Es un servicio gratuito para encadenar bicicletas, un servicio de renta de anuncios y mantenimiento de zonas lúdicas arbolado, un producto que se puede vender a negocios que quieran ofrecer a sus clientes estacionamientos para bicicletas.\r\nDato Duro sobre el cliente al cuál se quiere: El usuario del aparcabicis son los ciclistas clientes de los negocios, el cliente que pueda rentar el anuncio es la agencia de publicidad, el cliente del producto es la empresa socialmente responsable que debe contar con estacionamiento para bicicletas.\r\nAlcance: Rescatar el espacio público creando zonas verdes con rumbo a formar ciudades inteligentes. ", rubric_id: nil},
