  {user_id: 172, question_id: 167, answer_text: "Tendencia: Smart Cities\r\n2.000 millones de habitantes adicionales para 2050. Si no se toman medidas drásticas el crecimiento económico y demográfico tendrá un impacto medioambiental y social sin precedentes.                     http://www.sostenibilidad.com/que-es-una-smartcity-top-5-ciudades-inteligentes\r\n\r\nSe prevé que en el 2050 un 85% de la población mundial viva en ciudades. Este hecho hace que en las siguientes décadas los núcleos urbanos tengan que afrontar un número creciente de problemas ligados a este hecho http://www.endesaeduca.com/Endesa_educa/recursos-interactivos/smart-city/", rubric_id: nil},
  {user_id: 160, question_id: 165, answer_text: "Principalmente tiene que ver con cambios climáticos, los cuales afectaran a la salud de la población que va en  aumento. ", rubric_id: nil},
  {user_id: 172, question_id: 168, answer_text: "Tendencia: Smart Cities\r\nEl concepto de Smart City no solo se centra en los nuevos proyectos de crecimiento urbano: se dirige también a la adecuación de las actuales ciudades en ciudades inteligentes; Actualmente, los proyectos de remodelación y adecuación a las nuevas tecnologías se están llevando a cabo tanto en grandes urbes como en pequeños municipios, haciendo que las Smart Cities se conviertan en una realidad. http://www.endesaeduca.com/Endesa_educa/recursos-interactivos/smart-city/\r\n\r\nA nivel mundial, las ciudades ocupan solamente el 2% del espacio, pero consumen del 60% al 80% de la energía y generan el 75% de las emisiones de carbono. La urbanización rápida y desordenada de los países de America Latina y el Caribe ejerce presión sobre temas importantes como movilidad urbana, saneamiento básico, suministro de agua potable, contaminación del aire, respuesta frente a desastres, seguridad, salud y educación. En ALC, las ciudades medianas ya concentran 188,8 millones de personas, es decir, 36% de la población.  https://publications.iadb.org/bitstream/handle/11319/7743/La-ruta-hacia-las-smart-cities-Migrando-de-una-gestion-tradicional-a-la-ciudad-inteligente.pdf", rubric_id: nil},
