  {user_id: 206, question_id: 163, answer_text: "Partiendo  de mi interes en los temas de nuevas tecnologías, la disrupción y como todos estos nuevos desarrollos modifican la vida de las personas, haciendo búsquedas de información sobre nuevos métodos de marketing encontré un dispositivo llamado Beacon que se diseño con la finalidad de potenciar contenidos y conectar el mundo físico con el mundo virtual de Internet, es parte de las nuevas tecnologías que permiten crear conexiones para el Internet de las cosas. \r\n\r\nMe interesó mucho y quise conocer más así que contacte a la empresas en Polonia y adquirí un kit de desarrollo para conocer más como funciona. Tiene gran potencial, que depende del uso creativo que se le de. Cree contacto con el Jefe de ventas internacional y el contacto para Latinoamérica.\r\n\r\n\r\n\r\n", rubric_id: nil},
