  {user_id: 206, question_id: 164, answer_text: "Los siguientes escenarios son ejemplos de la utilidad que se puede desarrollar para los diferentes rubros.\r\n\r\nMedio ambiente. El dispositivo permite distribuir mucha información del tipo de mano como: volantes, folletos, trípticos, menús entre otros. Ya que el intercambio es digital, directamente al smartphone y solo cuando el usuario lo solicita.\r\n\r\nComunidad. Hay una aportación importante ya que se aplica el dispositivo en instituciones y dependencias públicas tiene un gran campo de acción en información de acceso inmediato. Se puede programar como un quiosco de información relevante e importante al momento que los usuarios necesitan una dirección, una asistencia, un teléfono, algo de información adecuada, etc. También tiene la utilidad de interactuar con los asistentes en lugares públicos, entre otros.\r\n\r\nSalud. Funciona de manera similar que en la comunidad, se desarrollan centros de contacto con el dispositivo mediante el cual los usuarios a través de su smartphone pueden pedir información, registrar citas o visitas, consultar datos, etc.\r\n\r\nEmpleo. Se crea un centro de contacto para oficios y comercios locales de manera que las personas puedan acceder pata publicar una actividad profesional o por el otro lado pedir datos de los servicios y comercios registrados, en una zona determinada.", rubric_id: nil},
