  {user_id: 154, question_id: 13, answer_text: "El principal problema es que las compañías comercializadoras solo se especializan en un sector en especial, por lo cual un cliente potencial tiene que recurrir a diferentes proveedores, para abastecer sus necesidades en cuanto acero. Se busca que un solo distribuidor maneje acero inoxidable, acero al carbón, aceros especiales y plásticos industriales, con un servicio justo a tiempo y con precios dentro del los parámetros del mercado. ", rubric_id: nil},
