  {user_id: 330, question_id: 169, answer_text: "   El problema que quiero solucionar: Que las personas que son fans de la saga de Harry Potter puedan tener un lugar en el cual puedan convivir.\r\n\r\nDato duro: Tokyo Disney Resort, que recibe cada año más de 25 millones de visitantes       \r\nDescripción:Según datos recopilados por expertos en la materia, en el año transcurrido desde que abrió sus puertas el impacto económico total resultante de haber atraído a diez millones de visitantes fue de un billón quinientos mil millones de yenes. Esto sirvió para que el sector del ocio japonés acaparara atención.\r\nLa Encuesta sobre Movimientos en el Sector de los Servicios Específicos del Ministerio de Economía, Comercio e Industria revela que en el año fiscal 2014 las ventas de los parques temáticos y de atracciones aumentaron un 6,8 % —628.900.000.000 yenes— respecto del ejercicio anterior. Fue la primera vez que el dato superó los seiscientos mil millones de yenes en un año fiscal y la mayor cifra desde que se comenzó a realizar el estudio en el 2000.      \r\nFuente: http://www.nippon.com/es/features/h00119/                                                              ", rubric_id: nil},
