  {user_id: 330, question_id: 171, answer_text: "Público que deseo atender: Fans de antaño y futuras generaciones que vayan conociendo el mundo magico\r\n\r\nDato: Mas de 60.000 fans den México\r\nDescripción: solo hay 4 lugares en México que son pequeños como lo mencione en la descripción pasada, y parques tematicos no hay mas que en grandes paises como EU, Inglaterra y Japon . Debemos de ver que es demasiado costoso ir a esos lugares y algo arriesgado, por lo que nosotros queremos atender al publico de México con un lugar como el que describimos en el ejercicio anterior, si crecemos en la ciudad de Guadalajara, que yo se que si, nos iremos a poner otras en otros estados y de allí irnos a otros países donde no haya parques tematicos.\r\nFuente:\r\nhttps://www.facebook.com/hpdmx/?fref=ts\r\nhttps://espanol.universalorlando.com/Parques-Tematicos/Wizarding-World-Of-Harry-Potter.aspx?__source=ps.google.RLSAINTLSPAwwohp&s_kwcid=AL!4228!3!100410501154!b!!g!!harry%20potter&ef_id=VfSmyAAABYB5Emub:20161206045333:s\r\nhttp://masedimburgo.com/2013/09/15/visita-harry-potter-warner-bros-studio-londres/\r\nhttp://www.notimerica.com/cultura/noticia-harry-potter-tiene-nuevo-parque-tematico-osaka-japon-20140722141409.html\r\n", rubric_id: nil},
