  {user_id: 330, question_id: 164, answer_text: "Comunidad: Ya que ayudaría a que grupos de personas se unieran, podrían encontrar un lugar en el cual se sentirían bienvenidos.\r\n\r\nCompromiso civico: Los buenos valores serían importantes aquí, debiso a que se enseña la tolerancia, solidaridad,amor, amistad, sed de justicia y compromiso por hacer un mundo mejor.\r\n\r\nEmpleo: En este rubro se trataría de contratar a estudiantes, los cuales necesitan ingresos para pagar sus estudios, necesitan empleos de medio turno bien pagados. También se les daría la oportunidad de entrar a trabajar a egresados para que obtengan experiencia en su area.\r\n\r\nBlance trabajo-Vida:  Ayudaría a que la gente no tenga que detenerse en dejar algo , o sacrificar algo, tratariamos de que la persona que este trabajando también tenga tiempo sin presión de sus estudios, casa y familia.\r\n\r\nSatisfacción ante la vida: Ya que queremos hacer un ambiente de buenos valores, lograremos que el empleado se sienta contento en su trabajo, que se sienta motivado para poder cumplir sus metas, ya que nosotros buscariamos una forma de ayudarle a alcanzarlas.", rubric_id: nil},
  {user_id: 330, question_id: 167, answer_text: "Personalización\r\n\r\nDato duro futuro:64% personalización de contenido en EU y Europa\r\nDescripción: Canales especidifcos para grupos con intereses similares\r\nfuente: http://ricardosegovia.com/markandcom/personalizacion-de-marketing-de-contenidos/\r\n\r\nDato: 67% personalización de contenido en EU y Europa\r\nDescripción: Conductas emocionales del usuario con la marca\r\nfuente:http://ricardosegovia.com/markandcom/personalizacion-de-marketing-de-contenidos/", rubric_id: nil},
  {user_id: 330, question_id: 170, answer_text: "Solución que ofrezco: Un lugar que tenga un restaurante, sala de proyección,  bibloteca, sala de estudio y tarea, salas para cada ''casa'' de Hogwarts y una tienda de articulos.\r\n\r\nDato: Hay mas de 60,000 fans en todo México \r\nDescripción: solo hay alrededor de 4 lugares pero solo en la ciudad de México, donde dos de ellos son restaurantes y los otros dos son lugares para comprar articulos. Ninguno de ellos tiene una bibloteca, una sala de proyección , espacio para cada una de las casas mucho menos un lugar para que los jovenes puedan ir hacer sus tareas.\r\nFuente:http://www.actitudfem.com/guia/vida-y-estilo/recomendaciones/4-lugares-especiales-para-fans-de-harry-potter-en-la-ciudad-de-mexico", rubric_id: nil},
  {user_id: 330, question_id: 173, answer_text: "Internacional", rubric_id: nil},
  {user_id: 330, question_id: 175, answer_text: "Bienestar:Una lugar para que los jovenes se sientan en familia, aprendan a convivir y buenos valores.\r\n\r\nDato duro sobre bienestar: Mas de 60, 000 fans en todo México no tienen un lugar de donde reunirse para poder convivir con personas similares a ellos\r\nTendencia directa: Tener todo lo referente necesario a la tematica del lugar para que el cliente se sienta atraído\r\n\r\nTendencia indirecta: Dar empleo a estudiantes bien pagados, ayudar a crecer el talento en nuestros trabajadores, motivar a seguir sus metas a nuestros trabajadores y nuestros clientes.\r\n\r\nDato duro sobre el problema que se busca solucionar: Solo existen 3 lugares en todo el mundo que son parques tematicos de Harry Potter, pero debido al costo y la distancia que estos tienen, buscamos un lugar que pueda tener algo de estos para las personas que no los pueden visitar.\r\n\r\nDato sobre el producto o servicio que se busca desarrollar:\r\nServicio de comida: Comida personalizada con el tema de la saga\r\nBibloteca: Un lugar donde puedan ir a leer las personas y puedan también tomar libros prestados.\r\nLugar de tareas: Area que tendrá algunos equipos de computo para apoyar a las tareas de los estudiantes, un lugar cómodo donde el estudiante no experiemente el estres\r\nSala de proyección: Lugar donde se puedan proyectar las peliculas de la saga de Harry Potter y también Animales Fantasticos\r\nTienda de articulos: Lugar donde podrán encontrar articulos, todo lo referente a la saga\r\nSalas para cada casa de Hogwarts: fan clubs, grupos de personas donde puedan reunirse a conocerse entre ellos, puedan convivir, hacer nuevas amistades y puedan tener comunicación entre ellos.\r\n\r\nDato sobre el cliente al cuál se quiere: Fans de antaño y futuras generaciones que les guste el mundo magico de Harry Potter\r\nAlcance: Primero queremos crecer a nivel nacional para luego ir a otros paises.", rubric_id: nil},
