  {user_id: 97, question_id: 32, answer_text: "De 30,001 a 40,000", rubric_id: nil},
  {user_id: 90, question_id: 168, answer_text: "El 42% de la electricidad, 21% del agua potable y el 25% de las emisiones de CO2 lo causan las viviendas solo en América latina.\r\n\r\nhttp://www.dinero.com/economia/articulo/la-necesidad-de-una-mayor-construccion-y-utilizacion-de-viviendas-sostenibles/223819\r\n\r\n\r\nLos isotopos de oxígeno y de carbono demuestran que las emisiones hace 56 millones de años se hicieron bastante lentamente. Durante unos 4 000 años concretamente, a un ritmo de 1 000 millones de toneladas de carbono al año. Comparativamente, las actividades humanas provocan actualmente emisiones de unos 10 000 millones de toneladas de carbono, es decir diez veces más.\r\n\r\nhttp://www.elcomercio.com/tendencias/emisiones-gases-efectoinvernadero-cambioclimatico-estudio.html.\r\n", rubric_id: nil},
  {user_id: 330, question_id: 163, answer_text: "El mundo ''magico´´ , la saga de Harry Potter   con la cual muchos jovenes tuvieron la esperanza de un mundo magico, un mundo diferente a comparación de donde vivían , el cual les ayudaba a no darsepor vencidos , seguir sus metas y cumplir sus sueños.\r\n\r\nMuchos jovenes encontraron un refugio en el cual podían ser comprendidos, podían conocer personas similares a ellos. A las personas que les gusta esta saga son personas con iniciativa, creativas, con valores, con ganas de  conocer el mundo, con pensamientos demasiado abiertos a los buenos cambios.", rubric_id: nil},
  {user_id: 330, question_id: 168, answer_text: "Dato actual: En 2020, Los algoritmos alterarán de manera positiva el comportamiento de más de mil millones de trabajadores en todo el mundo.\r\nDescripción: Los algoritmos contextualizados han avanzado de tal manera que incluyen una variedad de intervenciones conductuales, como la psicología, la neurociencia social y la ciencia cognitiva. Los algoritmos pueden cambiar positivamente el comportamiento de los humanos a través de un gran banco de memoria colectiva que permite a los trabajadores ‘recordar’ cualquier cosa o recibir información en el momento justo que la necesiten. Esto les permitirá realizar tareas más completas y apreciar mejor la vida.\r\nFuente:http://mundocontact.com/tag/realidad-aumentada/\r\n\r\nDato actual:El 68%\r\nDescripción: de los encuestados cree que el uso de la realidad virtual en el aula incentiva a los alumnos a estudiar.\r\nFuente: http://mundocontact.com/tag/realidad-aumentada/", rubric_id: nil},
