  {user_id: 90, question_id: 167, answer_text: "Las emisiones actuales, de origen humano (utilización de energías fósiles en particular) han causado un aumento de la temperatura de la Tierra de 1°C respecto a la era preindustrial, y anuncian un alza de 3 a 4°C de aquí 2100 si no se toma ninguna medida drástica.\r\n\r\nhttp://www.elcomercio.com/tendencias/emisiones-gases-efectoinvernadero-cambioclimatico-estudio.html.\r\n\r\nLas emisiones globales de gases de efecto invernadero (GEI) se eleven en 50%, debido al incremento de 70% en las emisiones de CO2 relacionadas con la generación de energía. El aumento de la temperatura media global sea de entre 3 °C y 6 °C hacia el\r\nfinal de siglo.\r\n\r\nhttps://www.oecd.org/env/indicators-modelling-outlooks/49884278.pdf\r\n", rubric_id: nil},
