  {user_id: 346, question_id: 153, answer_text: "El término Big Data se refiere a enormes cantidades de datos que por su complejidad y número tomaría demasiado tiempo y sería muy costoso cargarlos a un base de datos relacional para su análisis. De tal manera que, el concepto de Big Data aplica para toda aquella información que no puede ser procesada o analizada utilizando procesos o herramientas tradicionales. Las características de la Big Data son:\r\n\r\n-Volumen: La cantidad de información manejada es del tamaño de petabytes y hexabytes.\r\n\r\n-Velocidad: La velocidad con la que se genera la información ha hecho necesaria la creación de nuevas herramientas para su análisis.\r\n\r\n-Variedad: La variedad de los datos manejados (fotos, videos, mensajes de voz,documentos) es enorme\r\n\r\n-Variabilidad: El flujo con el que se generan es variable\r\n\r\n ", rubric_id: nil},
