  {user_id: 57, question_id: 150, answer_text: "La Globalización 3.0 se refiere a la manera en cómo el mundo está actualmente conectado, lo que permiten las plataformas y el internet.\r\nSe da como resultado de 10 eventos que han de converger en el 2000.\r\nSe dice que es 3.0 ya que viene después de la 1.0 la que estuvo caracterizada por conquistas de territorios, la 2.0 originada por empresas globales buscando sus proveedores y a su vez el mercado para sus productos.\r\nLa Globalización 3.0 revoluciona completamente la forma de hacer las cosas, ya todo puede compartirse, producirse, intercambiarse, etc, sin mover un pie de tu lugar. La colaboración entre personas dada por esta globalización crea un boom de posibilidades de innovación y creación. Por todo esto es que el autor menciona que se ha aplanado el mundo, no existen barreras para una comunicación global,y por ende para los desarrollos que esto conlleva.", rubric_id: nil},
