  {user_id: 79, question_id: 172, answer_text: "En cumplimiento de las disposiciones establecidas en la Ley General de Desarrollo Social, el CONEVAL presenta las estimaciones de pobreza a nivel nacional y para cada entidad federativa.​ Tzitzio es uno de los municipios con el mayor porcentaje en nivel de pobreza 85.7 %. http://www.coneval.org.mx/coordinacion/entidades/Michoacan/Paginas/pob_municipal.aspx. Con este proyecto se prevea crear navas fuentes de auto empleo para las familias. ", rubric_id: nil},
  {user_id: 105, question_id: 11, answer_text: "A ganaderos dedicados a la producción de leche del estado de Aguascalientes con un rango de edad de entre 35 y 60 años, con vacas en ordeña de 500 a 1500 cabezas.", rubric_id: nil},
  {user_id: 211, question_id: 170, answer_text: "DATO DURO: Aumentar competitividad, turismo, empleo, seguridad, calidad en productos y servicios, precio, posicionamiento, oportunidad de crecimiento para las pequeñas empresas o comercios,  los oficios y técnicos podrán tener oportunidad de formalizar empresas ,mejor servicio al cliente y detección de oportunidades para apertura de nuevas necesidades y empresas. DESCRIPCIÓN: encontramos una solución e crear un canal de comunicación o enlace u aplicación creativa  entre el  que oferta y demande. FUENTE: estudio de mercado que se realizo con ciudadanos y turistas.", rubric_id: nil},
  {user_id: 211, question_id: 171, answer_text: "DATO DURO: los beneficiados o atendidos son 1.- Sector Económico, 2.- sector turismo, y 3.- ciudadanos. DESCRIPCIÓN: el sector económico podrá volverse competente en cuanto a su calidad y precio generalizando,el sector turismo sabrá lo que hay en zacatecas y encontrar lo que desea mas rápidamente, y los ciudadanos podrán de tener la comodidad de encontrar productos y servicios de mejor calidad y precio, los proveedores zacatecanos podrán proveer X producto a donde sean necesitados. FUENTE: estudio de mercado realizado ", rubric_id: nil},
  {user_id: 191, question_id: 37, answer_text: "Persona física", rubric_id: nil},
  {user_id: 211, question_id: 172, answer_text: "DATO DURO: Generar empleo o elevar la tasa con la iniciativa privada existente DESCRIPCIÓN: generando competitividad en el sector económico para que haya mas oferta y demanda, calidad general en productos y servicios. BIENESTAR=EMPLEO=SEGURIDAD FUENTE:https://www.facebook.com/imcomx/?pnref=story Zacatecas lugar No. 26 en competitividad.", rubric_id: nil},
  {user_id: 211, question_id: 173, answer_text: "Nacional", rubric_id: nil},
  {user_id: 191, question_id: 9, answer_text: "Sí", rubric_id: nil},
  {user_id: 191, question_id: 10, answer_text: "Empleos dignos ", rubric_id: nil},
  {user_id: 191, question_id: 11, answer_text: "En Michoacán hay 71 mil 300 personas desempleadas, de los cuales casi 32 mil son jóvenes (44.7 por ciento)", rubric_id: nil},
  {user_id: 191, question_id: 12, answer_text: "los jóvenes ocupados michoacanos en términos de ingreso por trabajo están en una situación desfavorable, pues en el rango de los 3 hasta los 5 salarios mínimos, la entidad con 9.3 está 0.3 puntos por abajo del porcentaje de 9.6  a nivel nacional, mientras que en el rango de mayores ingresos, más de 5 salarios, Michoacán tiene menos de la mitad de la proporción que se tiene a nivel nacional", rubric_id: nil},
  {user_id: 211, question_id: 175, answer_text: "BIENESTAR: generando empleo, impulando la competitividad a traves de mas oferta y demanda en productos y servicios (sector economico) con el actual que cuenta Zacatecas, mejora la calidad en productos y servicios.\r\nDATO DURO SOBRE BIENESTAR: Zacatecas carece de calidad de vida, nivel socioeconomico, empleo, nivel bajo de turismo, seguridad, esto se debe al bajo indice de competitividad. Se pretende rectivar y desarrollar de una forma creativa e innovadora.\r\nMEGATENDENCIA: incluye la de CAMBIOS DEMOGRAFICOS Y SOCIALES Y URBANIZACION ACELERADA, estos incluyen a l proyecto dende podemos actuar.\r\nTENDENCIA DIRECTA: Podemos actuar como directa denominada SMARTCITIES y  ya que zacatecas esta aplicando tecnologias de informacion y comunicacion y nosotros pretendemos crear una solucion com estas ultimas. CREANDO beneficios como: 1.- desarrollo sostenible 2.- Incremento en calidad de vida de los ciudadanos 3.- Mayor eficacia de los recursos , productos y servicios disponibles  4.- una participacion de una ciudadana activa.\r\nTENDENCIA INDIRECTA: podemos incluirE-COMMERCE donde podemos crear ventajas competitivas al sector economico del estado y otros beneficios mas como : 1.- crear ventajas competitivas al sector economico 2.- mejor comunicacion en los clientes y efectividad de campañas publicitarias, 3.-posicionamiento de pequeñas marcas, 4.- Expandir la base de clientes al entrar a un mercado mas amplio.\r\nDATO DURO SOBRE EL PROBLEMA QUE SE DESEA SOLUCIONAR: Zacatecas se encuentra en el lugar no. 26 de 32 estados en tasa de nivel de indice de competitividad nivel nacional. El problema es la falta de competitividad en el sector economico entre otras dele estado.\r\nDATO DURO DEL PRODUCTO O SERVICIO QUE SE BUSCA DESARROLLAR: Encontre una posibilidad de crear un canal. enlace  o aplicacion (APP) para reactivar la competitividad, un mejor flujo de efectivo  y gracias a esto provocaremos que se eleven las tasas de empleo, seguridad, educacion, turismo y mejora de calidad de bienes, productos y servicios.\r\nDATO DURO SOBRE EL CLIENTE AL CUAL SE QUIERE : Tenemos 3 clientes destacados y beneficiados en un circulo vicioso de ingresos: 1.- El sector Economico 2.- Sector turismo 3.- Ciudadanos profesionistas, tecnicos , de oficio (ciudadanos)\r\nALCANCE: a que alcance puede llegar el proyecto a nivel : nacional", rubric_id: nil},
  {user_id: 3, question_id: 37, answer_text: "Persona física", rubric_id: nil},
