  {identifier: "Explicación", content: "Este es un texto aplicativo", video_url: nil},
  {identifier: "Titulo de contenido", content: "<p>Esta es una explicaci&oacute;n que pod&acute;ria tener imagenes y cosas as&iacute;</p>\r\n", video_url: nil},
  {identifier: "Respecto a: ", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/147/content_respectoa.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n", video_url: ""},
  {identifier: "¿Quién es realmente tu cliente?", content: "<p>Mauris ac orci dapibus, tincidunt ex eu, convallis nisi. Sed eleifend volutpat ex in consectetur. Suspendisse at mi vitae felis dignissim consectetur. Duis risus est, tincidunt in tristique quis, ultrices a augue. Nunc vel felis et diam tempus sagittis. Vivamus efficitur esar turpis, ut luctus metus scelerisque ultrices.</p>\r\n\r\n<p>&nbsp;</p>\r\n", video_url: "<iframe id=\"vzvd-8272116\" name=\"vzvd-8272116\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8272116/player\"></iframe>"},
  {identifier: "Otro contenido", content: "<p>Mauris ac orci dapibus, tincidunt ex eu, convallis nisi. Sed eleifend volutpat ex in consectetur. Suspendisse at mi vitae felis dignissim consectetur. Duis risus est, tincidunt in tristique quis, ultrices a augue. Nunc vel felis et diam tempus sagittis. Vivamus efficitur esar turpis, ut luctus metus scelerisque ultrices.</p>\r\n\r\n<p>Nunc dictum sed libero eu pretium. Phasellus feugiat suscipit metus. Suspendisse risus neque, finibus mattis sodales non, lobortis vel augue. Pellentesque quis libero quis odio ullamcorper lacinia ac sit amet ante. Integer blandit risus ut porta pellentesque. Integer in eleifend velit. Vivamus fermentum euismod bibendum.</p>\r\n", video_url: ""},
  {identifier: "gjhjh", content: "", video_url: "<iframe id=\"vzvd-8272116\" name=\"vzvd-8272116\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8272116/player\"></iframe>"},
  {identifier: "dsald", content: "<p>sdjalkda</p>\r\n", video_url: ""},
  {identifier: "dsada", content: "<p>dsada</p>\r\n", video_url: ""},
  {identifier: "dsad", content: "<p>dsadsad</p>\r\n", video_url: ""},
  {identifier: "Resumen del avance obtenido", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/150/content_Captura_de_pantalla_2016-11-16_a_la_s__00.03.05.png\" style=\"width: 800px; height: 428px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n", video_url: ""},
  {identifier: "Niveles Socioeconómicos", content: "<p>El siguiente paso es ubicar el nivel socioecon&oacute;mico en el que se sit&uacute;an los clientes o usuarios, esto ser&aacute; fundamental para validar el mercado.</p>\r\n", video_url: "<iframe id=\"vzvd-8321156\" name=\"vzvd-8321156\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8321156/player\"></iframe>"},
  {identifier: "Problema vs Necesidad", content: "<p>Empecemos por definir si tu idea de negocio est&aacute; enfocada hacia un Problema o una Necesidad:</p>\r\n", video_url: "<iframe id=\"vzvd-8320722\" name=\"vzvd-8320722\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8320722/player\"></iframe>"},
  {identifier: "Persona física vs persona moral", content: "<p>Ahora abordaremos otros puntos del cliente</p>\r\n", video_url: "<iframe id=\"vzvd-8320961\" name=\"vzvd-8320961\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8320961/player\"></iframe>"},
  {identifier: "Arquetipo del cliente", content: "<p>Es momento de especificar c&oacute;mo el tu cliente</p>\r\n", video_url: "<iframe id=\"vzvd-8320775\" name=\"vzvd-8320775\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8320775/player\"></iframe>"},
  {identifier: "Alcance Geográfico", content: "<p>Tener visi&oacute;n de las cosas y c&oacute;mo ir&aacute;n creciendo en tu negocio es fundamental.</p>\r\n", video_url: "<iframe id=\"vzvd-8320764\" name=\"vzvd-8320764\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8320764/player\"></iframe>"},
  {identifier: "¿Quién interviene en el proceso de compra?", content: "<p>Siempre ser&aacute; fundamental adentrarse a las condiciones que rodean a nuestro usuario, as&iacute; podremos entenderlo mejor y ofrecerle algo de mayor calida.</p>\r\n", video_url: "<iframe id=\"vzvd-8320841\" name=\"vzvd-8320841\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8320841/player\"></iframe>"},
  {identifier: "Innovación", content: "<p>Siempre se busca una soluci&oacute;n que involucre un aspecto de innovaci&oacute;n, descubre cu&aacute;les existen:</p>\r\n", video_url: "<iframe id=\"vzvd-8321257\" name=\"vzvd-8321257\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8321257/player\"></iframe>"},
  {identifier: "Solución", content: "<p>Es momento de abordar la soluci&oacute;n que propones a esa problem&aacute;tica que definimos desde el principio.</p>\r\n", video_url: "<iframe id=\"vzvd-8321206\" name=\"vzvd-8321206\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8321206/player\"></iframe>"},
  {identifier: "Beneficios", content: "<p>En el siguiente bloque determinaremos los beneficios de tu propuesta e idea de negocio:</p>\r\n", video_url: "<iframe id=\"vzvd-8320815\" name=\"vzvd-8320815\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8320815/player\"></iframe>"},
  {identifier: "Soluciones alternas", content: "<p>Una parte fundamental para entender a la competencia y por lo tanto a tu propia idea de negocio, es saber las opciones que existen para resolver la misma problem&aacute;tica.</p>\r\n", video_url: "<iframe id=\"vzvd-8321222\" name=\"vzvd-8321222\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8321222/player\"></iframe>"},
  {identifier: "Industria", content: "<p>Para poder definir correctamente a tu competencia, hay que entender la industria en la que te posicionas:</p>\r\n", video_url: "<iframe id=\"vzvd-8320887\" name=\"vzvd-8320887\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8320887/player\"></iframe>"},
  {identifier: "Etapas de la Industria", content: "<p>A continuaci&oacute;n aprender&aacute;s cu&aacute;les son las etapas en las que se dividen las industrias.</p>\r\n", video_url: "<iframe id=\"vzvd-8320862\" name=\"vzvd-8320862\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8320862/player\"></iframe>"},
  {identifier: "¿Cómo visualizas el alcance de tu proyecto?\v", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/148/content_alcance.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n", video_url: ""},
  {identifier: "Tendencias", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/149/content_Captura_de_pantalla_2016-11-15_a_la_s__23.38.48.png\" style=\"width: 800px; height: 434px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n", video_url: ""},
  {identifier: "Sectores Económicos", content: "<p>Otro aspecto importante a conocer de tu cliente, es la iniciativa a la que pertenece, pues esto se relaciona con temas como la toma de decisiones, el presupuesto con el que disponen para hacer compras y los intereses principales que tienen, entre otros.</p>\r\n", video_url: "<iframe id=\"vzvd-8320757\" name=\"vzvd-8320757\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8320757/player\"></iframe>"},
  {identifier: "Este es un contenido con imagen", content: "<p><img alt=\"TExto\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/2/content_1174960_312439932236031_1632323626_n.jpg\" style=\"width: 800px; height: 654px;\" /></p>\r\n", video_url: ""},
  {identifier: "Bienvenido", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/125/content_Construcci_n.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n", video_url: ""},
  {identifier: "Mercado", content: "<p>Ahora hay que definir el mercado al que te diriges, para saber lo m&aacute;s que podamos sobre ellos.</p>\r\n", video_url: "<iframe id=\"vzvd-8502093\" name=\"vzvd-8502093\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8502093/player\"></iframe>"},
  {identifier: "Tipo de adquisición", content: "<p>Esta parte es fundamental, es necesario identificar qui&eacute;n ser&aacute; el comprador final, as&iacute; como entender los distintos tipos de adquisici&oacute;n que podemos usar.</p>\r\n", video_url: "<iframe id=\"vzvd-8321187\" name=\"vzvd-8321187\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8321187/player\"></iframe>"},
  {identifier: "Introducción", content: "", video_url: "<iframe id=\"vzvd-8595423\" name=\"vzvd-8595423\" title=\"vzaar video player\" class=\"vzaar-video-player\" type=\"text/html\" width=\"768\" height=\"432\" frameborder=\"0\" allowFullScreen allowTransparency=\"true\" mozallowfullscreen webkitAllowFullScreen src=\"//view.vzaar.com/8595423/player\"></iframe>"},
  {identifier: "EJEMPLO", content: "<p>Del siguiente video, analiza y responde lo siguiente:</p>\r\n\r\n<p>1.- &iquest;A qu&eacute; megatendencia corresponde el video?</p>\r\n\r\n<p>R: Cambios Demogr&aacute;ficos</p>\r\n\r\n<p>2.- &iquest;Qu&eacute; problem&aacute;tica identificas?</p>\r\n\r\n<p>R: Acceso a la informaci&oacute;n</p>\r\n\r\n<p>3.- &iquest;Qu&eacute; tendencia utilizar&iacute;as para reducir la problem&aacute;tica?</p>\r\n\r\n<p>R: Marketing por causas, realizar una alianza con una empresa importante y vincularla a una organizaci&oacute;n enfocada a reducir la brecha educativa</p>\r\n", video_url: "https://youtu.be/9lsDJnlJqoY?list=PL2SOU6wwxB0vw9KvB_SZ4fKJlxQJl1G7a"},
  {identifier: "Idea ", content: "<p><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/6/content_Proceso1.JPG\" style=\"width: 720px; height: 403px;\" /><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n", video_url: ""},
  {identifier: "MEGATENDENCIAS", content: "<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<h2 style=\"text-align: center;\">Los <strong>cambios</strong> de gran escala que afectan a miles de personas en diferentes partes del mundo y modifican su estilo de vida, son conocidos como <strong>megatendencias </strong></h2>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/16/content_Rueda_Megatendencias.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n", video_url: ""},
  {identifier: "Herramienta de búsqueda ", content: "<h4 style=\"text-align: center;\"><br />\r\nAccesa al siguiente link :&nbsp;<a href=\"http://www.emprendemegatendencias.com/buscador/\">http://www.emprendemegatendencias.com/buscador/</a></h4>\r\n\r\n<h4 style=\"text-align: center;\">(Por favor mant&eacute;n esta nueva ventana de navegaci&oacute;n abierta para poder llevar a cabo los siguientes ejercicios)</h4>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/59/content_bussqu.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n", video_url: ""},
  {identifier: "El impacto de los cambios demográficos", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/81/content_CD2.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p><strong>Algunos indicadores demogr&aacute;ficos pueden incluir :</strong></p>\r\n\r\n<p>-Tama&ntilde;o de la poblaci&oacute;n</p>\r\n\r\n<p>-Tasa neta de nacimiento</p>\r\n\r\n<p>-Tasa de crecimiento de la poblaci&oacute;n</p>\r\n\r\n<p>-Tasa neta de mortalidad</p>\r\n\r\n<p>-Tasa de fertilidad</p>\r\n\r\n<p>-Esperanza de vida y mortalidad infantil</p>\r\n\r\n<p>-Tasa de distribuci&oacute;n proyectada y estimada de edad y genero en relaci&oacute;n a la fertilidad</p>\r\n", video_url: ""},
  {identifier: "Tendencias de los Cambios Climáticos y Escasez de Recursos", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/118/content_tendenciasCC.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n", video_url: ""},
  {identifier: "Tendencias de la Urbanización Acelerada", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/120/content_tendenciasUA.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n", video_url: ""},
  {identifier: "Invención VS Innovación ", content: "<p>&nbsp;</p>\r\n\r\n<p><meta charset=\"utf-8\" /></p>\r\n\r\n<p dir=\"ltr\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/8/content_ENMEX.JPG\" style=\"width: 698px; height: 393px;\" /></p>\r\n\r\n<p dir=\"ltr\">En M&eacute;xico el desarrollo de los ecosistemas de emprendimiento e innovaci&oacute;n est&aacute;n estrechamente ligados, si bien una idea puede dar lugar a la creaci&oacute;n de nuevas organizaciones, tambi&eacute;n la inserci&oacute;n de elementos innovadores en las entidades econ&oacute;micas existentes puede equipararlas otorg&aacute;ndoles ventajas en el mercado en el que compiten.</p>\r\n\r\n<p dir=\"ltr\">Para que dicha aceptaci&oacute;n suceda, se requieren propuestas con enfoques sin precedente que respondan a necesidades presentes o futuras para la generaci&oacute;n de bienestar; existen dos opciones:</p>\r\n\r\n<p dir=\"ltr\" style=\"text-align: center;\"><meta charset=\"utf-8\" /></p>\r\n\r\n<ol>\r\n\t<li dir=\"ltr\">\r\n\t<p dir=\"ltr\"><b id=\"docs-internal-guid-13ff78f3-5eb5-89f7-92a0-93026cbfcce8\">INVENCIONES -creaciones a partir de cero, </b></p>\r\n\t</li>\r\n\t<li dir=\"ltr\"><b id=\"docs-internal-guid-13ff78f3-5eb5-89f7-92a0-93026cbfcce8\">INNOVACIONES- &nbsp;las cuales poseen un factor adicional puesto que implica un enfoque de novedad y diferenciaci&oacute;n</b></li>\r\n</ol>\r\n\r\n<p><meta charset=\"utf-8\" />En M&eacute;xico el desarrollo de los ecosistemas de emprendimiento e innovaci&oacute;n est&aacute;n estrechamente ligados, si bien una idea puede dar lugar a la creaci&oacute;n de nuevas organizaciones, tambi&eacute;n la inserci&oacute;n de elementos innovadores en las entidades econ&oacute;micas existentes puede equipararlas otorg&aacute;ndoles ventajas en el mercado en el que compiten</p>\r\n\r\n<p><meta charset=\"utf-8\" />Desde la perspectiva de venta, dado que la innovaci&oacute;n funge como la relaci&oacute;n comercial entre las invenciones y sus usuarios potenciales, se entiende que los emprendedores no necesariamente tendr&aacute;n que inventar algo inexistente, sino contar con una oferta de valor diferenciada lo cual generar&iacute;a aceptaci&oacute;n al resultar &uacute;til ante las necesidades y problemas del arquetipo en particular o de la poblaci&oacute;n, es decir, clientes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n", video_url: ""},
  {identifier: "Origen de las ideas de negocio ", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/7/content_origen.JPG\" style=\"width: 628px; height: 373px;\" /></p>\r\n\r\n<p style=\"text-align: justify;\">La generaci&oacute;n de ideas es un proceso mental inherente a la esencia humana, &eacute;stas nacen de forma abstracta como representaciones mentales, pensamientos con prop&oacute;sito, ilusiones, creencias o productos de la imaginaci&oacute;n, mismas que -en conjunto- son la base a partir de la cual se puede llegar a realizar un concepto, ya sean expectativas, sue&ntilde;os o acciones.</p>\r\n\r\n<p style=\"text-align: justify;\">Las ideas -de negocio, enti&eacute;ndase como la concepci&oacute;n de un bien o servicio que puede ser ofrecido a la sociedad, son el n&uacute;cleo de las c&eacute;lulas econ&oacute;micas a partir de las cuales se buscan satisfacer necesidades o atender problemas; no obstante, una idea por s&iacute; misma no es suficiente para construir un contexto real para el desarrollo de negocios.</p>\r\n\r\n<p style=\"text-align: center;\"><meta charset=\"utf-8\" /></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align: center;\"><meta charset=\"utf-8\" /></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align: center;\"><u><strong>Es decir, las ideas son solo el comienzo de un proceso m&aacute;s largo y complejo, que requiere de un conjunto de elementos para materializarse y lograr una aceptaci&oacute;n en el mercado.</strong></u></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align: justify;\"><meta charset=\"utf-8\" />El mito de que las ideas ocurren de forma fortuita es peligroso para aquellos que desean emprender , es decir, estas no son instant&aacute;neas sino que parten de un proceso de <strong>iteraci&oacute;n constante , de prueba y error. </strong></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align: justify;\">La generaci&oacute;n de ideas usualmente nace al estar involucrado en actividades, al estar haciendo cosas y conectar elementos, y es cuando la creatividad encuentra la parte humana de nuestra existencia, como lo hizo con Arqu&iacute;medes, mientras descubri&oacute; el concepto de densidad mientras el agua aumentaba en la ba&ntilde;era cuando &eacute;l sumergi&oacute; su cuerpo</p>\r\n", video_url: ""},
  {identifier: "Cambios Climáticos y Escasez de Recursos", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/88/content_CC3.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p><strong>La escasez es un t&eacute;rmino relativo,&nbsp;</strong>debido a que se miden los recursos en comparaci&oacute;n a las necesidades que se pretenden satisfacer, y, en este sentido, esos recursos son siempre insuficientes, limitados, o escasos para cubrir todas las necesidades y todos los deseos.<br />\r\nSin embargo, la escala de la escasez es diferente para las distintas personas o sociedades.<br />\r\nLo que estamos experimentando es que la capacidad del planeta no est&aacute; alcanzando para responder al actual modelo de&nbsp;<strong>desarrollo econ&oacute;mico.</strong></p>\r\n", video_url: ""},
