  {identifier: "Urbanización Acelerada", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/94/content_UA.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n", video_url: ""},
  {identifier: "La urbanización no es únicamente un incremento simple en el número de residentes urbanos", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/95/content_UA2.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p>Sin embargo la esencia de la interacci&oacute;n entre urbanizaci&oacute;n y crecimiento es algo sumamente diferente y m&aacute;s complejo,&nbsp;<strong>nuestro entendimiento de las ciudades est&aacute; cambiando,</strong>&nbsp;a trav&eacute;s de las disciplinas de complejidad cient&iacute;fica y la teor&iacute;a de la auto organizaci&oacute;n , ahora percibimos a las ciudades como sistemas biol&oacute;gicos que como sistemas mec&aacute;nicos.</p>\r\n", video_url: ""},
