  {identifier: "Visión", content: "<p style=\"text-align: center;\"><b id=\"docs-internal-guid-13ff78f3-5ebb-853f-c7b2-881d3060c171\">&iquest;C&oacute;mo ocurre este proceso en nuestro pa&iacute;s?<br />\r\n&iquest;Hacia d&oacute;nde apunta la visi&oacute;n de los emprendedores mexicanos?<br />\r\n&iquest;Qu&eacute; factores influyen en las ideas de negocio que nacen en tierra Mexica?</b></p>\r\n\r\n<p>Los datos acerca del emprendimiento en M&eacute;xico resaltan que la mortandad de las empresas mexicanas de nueva creaci&oacute;n a 2015 sigue siendo corta y desigual en cada estado (desde 3.8 a&ntilde;os en Oaxaca hasta 9.1 a&ntilde;os en Yucat&aacute;n).</p>\r\n\r\n<p><strong><u>La innovaci&oacute;n como un elemento clave en el desarrollo, exige del emprendedor sensibilidad y una visi&oacute;n m&aacute;s amplia y consciente, la cual sea capaz no s&oacute;lo de reconocer un universo de datos, sino de la informaci&oacute;n que estos muestran, para generar el conocimiento a partir de ellos y darle utilidad pr&aacute;ctica.</u></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><meta charset=\"utf-8\" /></p>\r\n\r\n<p><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/10/content_undatos.JPG\" style=\"width: 657px; height: 369px;\" /><meta charset=\"utf-8\" /></p>\r\n\r\n<p>Es decir, la generaci&oacute;n de ideas y creatividad implica una observaci&oacute;n profunda, capacidad cr&iacute;tica y anal&iacute;tica que no solo permita identificar lo que no funciona, sino tambi&eacute;n lo que se necesita o lo que se podr&iacute;a mejorar, con enfoque en la soluci&oacute;n que se puede crear.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/9/content_visi_n.JPG\" style=\"width: 679px; height: 372px;\" /></p>\r\n\r\n<p style=\"text-align: justify;\">Los diferentes sistemas de informaci&oacute;n en el pa&iacute;s permiten a los emprendedores tener acceso principalmente a datos econ&oacute;micos, sociales, ambientales y gubernamentales &nbsp;(entre otros), los cu&aacute;les mediante su adecuada interpretaci&oacute;n y uso pueden agregar valor a los proyectos mexicanos</p>\r\n\r\n<p style=\"text-align: justify;\"><meta charset=\"utf-8\" />Pero, &iquest; Est&aacute;n al tanto los emprendedores de la existencia de estas opciones? &iquest;Se informan antes de emprender?</p>\r\n\r\n<p style=\"text-align: justify;\">Para empresas de nueva creaci&oacute;n el contar con una justificaci&oacute;n estad&iacute;stica y econ&oacute;mica que respalde la existencia de una necesidad o de una problem&aacute;tica no s&oacute;lo ayuda al emprendedor a fijar el arquetipo al que ofrecer&aacute; sus productos o servicios y el mercado al que atender&aacute; ,sino que adem&aacute;s brinda un grado de seguridad ante inversionistas potenciales.</p>\r\n\r\n<p style=\"text-align: justify;\">La informaci&oacute;n es s&oacute;lo el comienzo de un proceso de contextualizaci&oacute;n que los emprendedores mexicanos necesitan utilizar a su favor para mitigar riesgos y reducir incertidumbres y generar ideas de valor.</p>\r\n", video_url: ""},
  {identifier: "Visión", content: "<h2 style=\"text-align: center;\">La innovaci&oacute;n como un elemento clave en el desarrollo, exige del emprendedor sensibilidad y una visi&oacute;n m&aacute;s amplia y consciente, la cual sea capaz no s&oacute;lo de reconocer un universo de datos, sino de la informaci&oacute;n que estos muestran, para generar el conocimiento a partir de ellos y darle utilidad pr&aacute;ctica.</h2>\r\n\r\n<p style=\"text-align: center;\"><u><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/21/content_content_undatos.JPG\" style=\"width: 657px; height: 369px;\" /></u></p>\r\n\r\n<h2 style=\"text-align: center;\">&nbsp;</h2>\r\n", video_url: ""},
