  {identifier: "¿Cómo nacen las ideas de negocio?", content: "<p style=\"text-align: center;\">&nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/45/content_origen1.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Nacen de forma abstracta como representaciones mentales, pensamientos con prop&oacute;sito, ilusiones, creencias o productos de la imaginaci&oacute;n, mismas que -en conjunto- son la base a partir de la cual se puede llegar a realizar un concepto.</strong></p>\r\n", video_url: ""},
  {identifier: "El poder de la innovación", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/107/content_CT2.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p style=\"text-align: center;\"><strong>En un mercado globalizado,&nbsp;</strong>el factor que juega el rol principal respecto a los niveles de competitividad dentro de las industrias es la innovaci&oacute;n tecnol&oacute;gica. La tecnolog&iacute;a es una de las fuerzas disruptivas en las organizaciones. De hecho, los impactos de la disrupci&oacute;n digital son ahora tan penetrantes que ning&uacute;n negocio en ning&uacute;n sector es inmune a ellos.</p>\r\n", video_url: ""},
