  {identifier: "Tipos de cambios y su trascendencia - MODAS", content: "<h2 style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/51/content_t1.jpg\" style=\"width: 800px; height: 450px;\" /></h2>\r\n\r\n<h4 style=\"text-align: justify;\">La <strong>&quot;MODAS&quot; </strong>son&nbsp;un entusiasmo compartido por algo, con un periodo de vida m&aacute;s corto que las tendencias, el proceso de racionalizaci&oacute;n del mismo es bajo, sin embargo tiene un inter&eacute;s y presencia intensa que parece atraer a un grupo grande de personas con ellos.</h4>\r\n\r\n<h4 style=\"text-align: justify;\">Una de las caracter&iacute;sticas principales de las modas es que ganan&nbsp;popularidad de manera r&aacute;pida y pueden&nbsp;desaparecer con esa misma rapidez.</h4>\r\n\r\n<ol>\r\n</ol>\r\n", video_url: ""},
