  {identifier: "¿Cómo surgen las ideas de negocios-?", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/46/content_or2.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Las ideas -de negocio buscan satisfacer necesidades o atender problemas; no obstante, una idea por s&iacute; misma no es suficiente para construir un contexto real para el desarrollo de negocios.</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong><u>Es decir, las ideas son solo el comienzo de un proceso m&aacute;s largo y complejo, que requiere de un conjunto de elementos para materializarse y lograr una aceptaci&oacute;n en el mercado.</u></strong></p>\r\n", video_url: ""},
  {identifier: "Si pudieras predecir los cambios del futuro...", content: "<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><strong>&iquest; Qu&eacute; decisiones tomar&iacute;as hoy?</strong></h1>\r\n\r\n<p>{{video}}</p>\r\n\r\n<p>&nbsp;</p>\r\n", video_url: "<iframe src=\"https://player.vimeo.com/video/191015807\" width=\"640\" height=\"360\" frameborder=\"0\" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe> <p><a href=\"https://vimeo.com/191015807\">Emprende en Megatendencias</a> from <a href=\"https://vimeo.com/distritoemprendedor\">Distrito Emprendedor</a> on <a href=\"https://vimeo.com\">Vimeo</a>.</p>"},
  {identifier: "Cambios Climáticos y Escasez de Recursos", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/87/content_CC.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n", video_url: ""},
  {identifier: "Tipos de cambios y su trascendencia - TENDENCIAS", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/52/content_t2.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<h4>Las tendencias son&nbsp;un patr&oacute;n de cambio gradual en una condici&oacute;n, resultado o proceso , el cual se mueve en cierta direcci&oacute;n a trav&eacute;s del tiempo, la tendencia implica la preferencia que alguien tiene hacia un fin determinado.</h4>\r\n\r\n<h4>Se forman con mayor certeza que las modas.</h4>\r\n\r\n<h4>Existe m&aacute;s racionalizaci&oacute;n en ellas dado que existen indicadores, su amplitud y la profundidad de sus efectos son probabil&iacute;sticos.</h4>\r\n", video_url: ""},
  {identifier: "Tipos de cambios y su trascendencia - MEGATENDENCIAS", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/53/content_t4.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p style=\"text-align: justify;\">Las<strong> &quot;megatendencias&quot; </strong>son fruerzas globales y transformativas que definen el futuro, teniendo un gran impacto en negocios, sociedades, econom&iacute;as, culturas y vidas personales, tardan en formarse , pero sus efectos son a gran escala a trav&eacute;s del tiempo , son visibles gracias a que estan com&uacute;nmente basadas en hechos.</p>\r\n", video_url: ""},
  {identifier: "Videoclip de innovación", content: "<h2 style=\"text-align: center;\"><u><strong>Instrucciones</strong></u></h2>\r\n\r\n<p><strong>1. Accesa a la herramienta de b&uacute;squeda en el siguiente link :&nbsp;</strong>http://www.emprendemegatendencias.com/buscador/index.php</p>\r\n\r\n<p><strong>2. Selecciona la megatendencia : </strong>&quot;Avances tecnol&oacute;gicos&quot;</p>\r\n\r\n<p><strong>3. Selecciona temporalidad : </strong>&quot; Corto plazo (menos de 3 a&ntilde;os)</p>\r\n\r\n<p><strong>4. Observa el video</strong> &quot; Liam,una historia de innovaci&oacute;n&quot;</p>\r\n\r\n<p><strong>5. Contesta las siguientes preguntas con base en el video que acabas de observar:</strong></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/61/content_navega.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n", video_url: ""},
  {identifier: "Nuevos patrones de consumo ", content: "<p style=\"text-align: center;\"><img alt=\"\" src=\"https://commondatastorage.googleapis.com/edcdigital/uploads/ckeditor/pictures/100/content_CP2.jpg\" style=\"width: 800px; height: 450px;\" /></p>\r\n\r\n<p>Al discutir cambios en el poder econ&oacute;mico mundial el enfoque generalmente es en el poder econ&oacute;mico de las naciones, a pesar de que en realidad el poder econ&oacute;mico es ejercido por<strong>&nbsp;subgrupos entre pa&iacute;ses.</strong></p>\r\n", video_url: ""},
