  {question_type: 4, question_text: "Nivel socioeconómico del usuario (Opción 1)", position: nil, answer_options: "A/B: Es el segmento con el más alto nivel de vida del país.\r\nC+: Es el segundo estrato con el más alto nivel de vida del país; tiene cubiertas todas las necesidades relacionadas a calidad de vida.\r\nC: Este segmento se caracteriza por haber alcanzado un nivel de vida práctica y con ciertas comodidades. Se caracteriza por contar con elementos básicos de entretenimiento y tecnología. \r\nC-: Los hogares de este nivel se caracterizan por tener cubiertas las necesidades de espacio y sanidad, así mismo por contar con mobiliario que le permite vivir de una manera práctica y cómoda.\r\nD+: Este segmento tiene cubierta la mínima infraestructura sanitaria de su hogar.\r\nD: Los hogares dentro de este nivel se caracterizan por haber alcanzado una propiedad, pero carecen de la mayoría de los servicios y bienes satisfactores. \r\nE-: Carece de todos los servicios y bienes satisfactores; es el nivel socio económico con menor calidad de vida o bienestar. ", support_text: "Analiza las alternativas y, conforme a las características descritas, selecciona la que más haga sentido al perfil de tu usuario -cliente.\r\n\r\nPara conocer más, te sugerimos visitar la siguiente página: http://nse.amai.org/nseamai2/", points: 2, support_image: "ARQUETIPO_DEL_CLIENTE-08.png"},
