  {question_type: 4, question_text: "De los siguientes perfiles, ¿cuál representa el mayor porcentaje de tus clientes? Es decir, tu cliente más común. \t", position: nil, answer_options: "Innovadores: Clientes que se sienten muy cómodos con la tecnología  y les importa más la función que la forma. Se preocupan por descrubrir nuevos usos a un producto.\r\nPrimeros adoptantes: Personas que se atreven a adoptar una nueva tecnología o producto cuando entienden que su uso puede traer beneficios en su empresa a reserva de que existan pocas referencias similares en el mercado. Están dispuestos a gastar recursos si el producto soluciona su problema.\r\nPrimera mayoría o pragmáticos: Personas que esperan un producto terminado, tardan un poco en adoptar nuevas tecnologías pero si están dispuestos a incorporar a su entorno un producto nuevo.\r\nMayoría tardía o conservadores: Consideran las innovaciones algo de lo cual desconfiar. Son tradicionales y cautelosos a la hora de adoptar un nuevo producto o tecnología y lo hacen cuando ya es algo común en el mercado.\r\nRezagados o escépticos: Personas que no quieren o son muy cautelosos al adoptar nuevas tecnologías, toman el pasado como referencia y únicamente adoptan un producto cuando existe una fuerte presión en el entorno por hacerlo.", support_text: "Para conocer más, te sugerimos consultar la siguiente fuente: http://javiermegias.com/blog/2012/12/early-adopters-clave-nuevo-modelo-de-negocio-curva-adopcion-tecnologia/", points: 2, support_image: "ARQUETIPO_DEL_CLIENTE-06.png"},
