  {user_id: 44, answer_id: 1180, content: "Esta empresa es social y tiene dos clientes directos: el cliente a quien nosotros llamamos el \"cliente social\" y el cliente comercial.\r\n\r\nEl cliente comercial es el \"cliente comprador\" de vegetales, que produce el 99% de los ingresos de la empresa. Es el comercio detallista que vende vegetales a los consumidores directos y puede ser persona física o moral. Pretendemos enfocafrnos principalmente a la persona moral.\r\n\r\nEl \"cliente social\" es una persona física, típicamente mayor de 50 años, que instalará en su casa un invernadero que la empresa le \"rentará\" y por lo tanto generará ingresos para la empresa por concepto de renta de los invernaderos. La empresa también le venderá a esa persona \"plántulas\" (brotes vegetales) para cultivarlas en los invernaderos.\r\n\r\nEste \"cliente social\" se convertirá en \"proveedor\" de los vegetales cultivados para la empresa.", archived: false, question_id: nil, owner_id: nil},
