  {user_id: 235, answer_id: 2223, content: "bueno principalmente va a ir enfocado a la sociedad estudiantil pero , cualquier otra persona desde amas de casas o hasta ejecutivos podrán hacer uso de esta", archived: false, question_id: nil, owner_id: nil},
  {user_id: 228, answer_id: 2247, content: "Mi servicio esta a disposición de todo publico. Repostería.", archived: false, question_id: nil, owner_id: nil},
  {user_id: 228, answer_id: 2257, content: "El comprador adquirirá mi producto para consumo propio o también para venderlo.", archived: false, question_id: nil, owner_id: nil},
  {user_id: 44, answer_id: 2300, content: "La empresa ss una combinacoión de servicio para los agricultores urbanos de la tercera edad que trabajarán en sus casas, que consiste en la asesoría para producción de vegetales orgánicos en invernaderos hidropónicos, con el servicio de recolección de la cosecha.\r\n\r\nLa empresa empacará y comercializará los productos en tiendas de autoservicio, especializadas y  gourmet, así como en restaurantes gourmet.", archived: false, question_id: nil, owner_id: nil},
  {user_id: 171, answer_id: 3497, content: "En la pagina del niego no encontré ninguna datos, adicional, loas estadísticas difieren mucho de un análisis a otro.", archived: false, question_id: nil, owner_id: nil},
  {user_id: 330, answer_id: 3601, content: "Tal vez suene muy loca mi idea de negocio, o suene imposible, pero este mundo a muchos les ha dado una forma diferente de pensar a la vida, por ejemplo a mi hizo que tuviera mas pensamientos creativos y no dejara de luchar por mis metas. Deseo con mi corazón que todos aquellos amantes de esta saga tengan un lugar donde reunirse y que no sea caro, que cuando termines d eponer varios lugares de esos en México pueda ir a otros países los cuales no son tomados en cuenta por no ser grandes.", archived: false, question_id: nil, owner_id: nil},
  {user_id: 44, answer_id: 1180, content: "Esta empresa es social y tiene dos clientes directos y uno indirecto: los directos son el cliente a quien nosotros llamamos el \"cliente social\" y el cliente comercial. El cliente comercial es el \"cliente comprador\" de vegetales, que produce el 99% de los ingresos de la empresa, es el comercio detallista que vende vegetales a los consumidores y puede ser persona física o moral. Pretendemos enfocarnos principalmente a la persona moral. El \"cliente social\" es una persona física, típicamente mayor de 50 años, que instalará en su casa un invernadero que la empresa le \"rentará\" y por lo tanto generará ingresos para la empresa por concepto de renta de los invernaderos. La empresa también le venderá a esa persona \"plántulas\" (brotes vegetales) para cultivarlas en los invernaderos. Este \"cliente social\" se convertirá en \"proveedor\" de los vegetales cultivados para la empresa.\r\n\r\nEl cliente indirecto es el consumidor de vegetales orgánicos, que es un habitante citadino mayor de 18 y menor de 60 años, con conciencia ecológica y social, ingresos medios o altos, informado, usuario de la tecnología.", archived: false, question_id: nil, owner_id: nil},
  {user_id: 44, answer_id: 2351, content: "La empresa es innovadora principalmente en los grupos destinatarios del beneficio de obtener un trabajo remunerado, ya que si bien las personas de la tercera edad serán los principales beneficiarios, también podrán participar personas con ciertas limitaciones motrices y personas que, sin ser de la tercera edad o con limitaciones físicas, podrán instalar un invernadero en sus hogares para proveer o mejorar sus ingresos familiares o comunales. Simplemente deberán contar con el espacio, el tiempo y la conexión a internet.\r\n\r\nTal es el caso de amas de casa sin empleo remunerado, personas desempleadas, conventos, orfanatos, etc.\r\n\r\nEl proceso del ciclo producción-distribución también es innovador debido a que los agricultores urbanos se encontrarán en la misma localidad física que los consumidores finales, considerando que ambos vivirán en la misma ciudad.", archived: false, question_id: nil, owner_id: nil},
  {user_id: 44, answer_id: 2358, content: "Este proyecto está diseñado para generar un impacto en áreas múltiples:\r\n\r\nEn el aspecto social, contribuye a generar bienestar en la población de la tercera edad, de personas con limitaciones físicas, de personas desempleadas y de otros grupos vulnerables, de una manera productiva, no asistencialista, pues las personas generarán sus propios ingresos mediante un trabajo útil para el medio ambiente, para su comunidad y para sí mismos\r\n\r\nAl sentirse útiles estas personas, el impacto en su autoestima, en su bienestar económico y en su entorno, repercutirá positivamente en su autoimagen general y en su salud mental. El adquirir una nueva habilidad y que ésta sea compartida con un grupo de agricultores urbanos iguales que él, le generará un sentido de pertenencia a un grupo.\r\n\r\nEs evidente que al generar ingresos por una actividad productiva, también generarán consumo y pago de impuestos, al desarrollo económico general.", archived: false, question_id: nil, owner_id: nil},
  {user_id: 275, answer_id: 2556, content: "Los rangos son muy variados ya que los turistas son un mercado demasiado amplio ", archived: false, question_id: nil, owner_id: nil},
