  {user_id: 121, answer_id: 3518, content: "Ventas en línea:\r\n• Al igual que en el estudio de 2015, la mayoría de las ventas en línea se realizaron desde México, y dos de cada tres ventas en línea se hicieron a través de una PC. Los comercios reportaron un pequeño porcentaje de devoluciones al usuario.\r\n• La ropa y los accesorios, deportes y fitness, continuaron representando las dos categorías principales vendidas por los comercios en línea.\r\n• Cuando se trata de valor de ventas, sin incluir viajes, las tres principales categorías fueron categorías que no se mencionaron en la encuesta; ropa y\r\naccesorios y productos electrónicos de consumo. \r\n• Los comercios esperaban que las ventas aumentaran alrededor del Buen Fin, Navidad y HotSale. ", archived: false, question_id: nil, owner_id: nil},
